	["companion"] = {
		["0104193915ukPYf"] = {
			["PE"] = {
				["v"] = 1,
			},
			["data"] = {
				["TX"] = "It was gifted to Charles by the Tol'vir priests from Uldum for his help during the researching of the Tol'vi history.",
				["read"] = false,
				["BK"] = 1,
				["NA"] = "Uldum'avara",
				["IC"] = "ABILITY_MOUNT_CAMEL_TAN",
				["v"] = 3,
			},
			["links"] = {
				["Ascrofte-ArgentDawn_88749"] = 1,
			},
		},
		["0210224141gPhlG"] = {
			["data"] = {
				["TX"] = "A young lad at the ripe age of fourteen! Born and raised within Stormwind's safe walls, he one day felt that his heart burned for adventure and sought his way down to the buzzing harbor where he, scrawny as he may be, managed to find swift employment upon a privateering frigate heading for Tanaris! \n\nHe soon learned that sailing was not only about feeling the fresh ocean wind through your hair and singing  chanteys with the other sailors. It was tough work upon body and mind. He found his skill and strenght suddenly patheticly lacking and soon became a target for mockery by the more experienced men and women upon the vessel. Especially the fact that he never spoke quickly became the subject for endless teasing, but he learned to endure it.\n\nHe had one good thing running for him however. He had been a quick study back in Stormwind with a wit quicker than most. He began to follow some of the sailors around, watching what they did and memorizing it. One particular man by the name of Beid soon became his involuntary teacher, and despite the rough sailor's hot temper earning him almost as many bruises as the labor itself did, he found that the rewarding knowledge far outweighted the physical torment. Another reason that he remained with this particular sailor, was that he didn't seem to mind that Dennis never spoke where as plenty of others often got annoyed with this little peculiarity. Soon he would barely leave Beid's side, sucking in all he could about the ways of handling a ship at sea. Beid had soon grown accustomed to his company, and the teachings came more willingly as time went by. Then came the day where they docked in Gadgetztan...",
				["read"] = true,
				["IC"] = "INV_Pet_Broom",
				["BK"] = 1,
				["TI"] = "Swabby",
				["NA"] = "Dennis",
				["v"] = 3,
			},
			["PE"] = {
				["1"] = {
					["AC"] = true,
					["TI"] = "Appearance",
					["IC"] = "Spell_Nature_NatureTouchGrow",
					["TX"] = "The boy's quite scrawny for his age! Arms not much more than twigs of a young tree. He stands 5'5 feet tall, quite ordinary for his age. His by now scruffy hair carries a brown-blonde colour and upon his chin the very first meagre signs of what would one day become a beard of the same colour has begun to show.",
				},
				["3"] = {
					["AC"] = true,
					["TI"] = "Mute?",
					["IC"] = "INV_Misc_GroupLooking",
					["TX"] = "The lad doesn't speak much, if at all! Either mute or incredibly shy.",
				},
				["2"] = {
					["AC"] = true,
					["TI"] = "Dirty and bruised",
					["IC"] = "Ability_Skyreach_Wind",
					["TX"] = "Getting used to the laboring life ain't easy for a city-boy!",
				},
				["4"] = {
					["AC"] = true,
					["TI"] = "Fleet-footed!",
					["IC"] = "Ability_Rogue_FleetFooted",
					["TX"] = "He's quite the quick little lad when he needs to be! A skill quite usefull upon a ship where most people gladly would slap a youngster around!",
				},
				["v"] = 1,
			},
			["links"] = {
				["Beid-ArgentDawn_Dennis"] = 1,
			},
		},
		["0605122403PqU2l"] = {
			["PE"] = {
				["1"] = {
					["AC"] = true,
					["TI"] = "Undead",
					["TX"] = "Pablo is undead.",
					["IC"] = "Ability_DeathKnight_NecroticAura",
				},
				["2"] = {
					["AC"] = true,
					["TI"] = "Careful around his ear!",
					["TX"] = "Pablo's left ear is falling off, but has been stitched into place.",
					["IC"] = "Ability_DeathKnight_Asphixiate",
				},
				["3"] = {
					["AC"] = true,
					["TI"] = "Pet him!",
					["TX"] = "Pablo like being petted.\n...Most of the time.",
					["IC"] = "Ability_Druid_ProtectorOfThePack",
				},
				["v"] = 1,
			},
			["data"] = {
				["TX"] = "Pablo was found by Ardisal as a corpse.\nArdisal, feeling lonely, took pity on him and raised him into undeath to be his pet.",
				["read"] = false,
				["NH"] = "691d15",
				["IC"] = "INV_Weapon_Crossbow_22",
				["BK"] = 1,
				["TI"] = "Ardisal's Dog || A Good Boy",
				["NA"] = "Pablo",
				["v"] = 9,
			},
			["links"] = {
				["Ardisal-ArgentDawn_Pablo"] = 1,
			},
		},
		["1206212435yGUb8"] = {
			["data"] = {
				["TX"] = "Tarkin is a lesser demon summoned by Aros on rare occasions. Aros bound the demon to his will during his younger years while exploring the abandoned Lamora mansion in Alterac. Tarkin tried to sneak behind Aros the warlock proved too sensitive to demonic magic and trapped the demon by muttering an incantation.\n\nSince then, Tarkin faithfully serves Aros for fear of retribution. However, the imp resents its master, but acknowledges that the gap in power far exceeds his probability of escape or rebellion.",
				["read"] = true,
				["NH"] = "ff0008",
				["IC"] = "Ability_Warlock_EmpoweredImp",
				["NA"] = "Tarkin",
				["TI"] = "The Trickster",
				["BK"] = 1,
				["v"] = 3,
			},
			["PE"] = {
				["1"] = {
					["AC"] = true,
					["TI"] = "Level 1",
					["IC"] = "Achievement_PVP_P_01",
					["TX"] = "This demon is very easy to summon and control.",
				},
				["3"] = {
					["AC"] = true,
					["TI"] = "Manic Attacker",
					["IC"] = "ability_rogue_dirtydeeds",
					["TX"] = "The imp, while small and easy to overpower, attacks with manic fury which may catch the foe by surprise.",
				},
				["2"] = {
					["AC"] = true,
					["TI"] = "Demonic Aura",
					["IC"] = "Ability_BossDarkVindicator_AuraofMalice",
					["TX"] = "The demon emanates a demonic aura which can be picked up by anyone sensitive to it.",
				},
				["5"] = {
					["AC"] = true,
					["TI"] = "Agile",
					["IC"] = "Ability_Rogue_Sprint",
					["TX"] = "The imp is agile and is able to run faster than other demons.",
				},
				["4"] = {
					["AC"] = true,
					["TI"] = "Sharp Claws",
					["IC"] = "artifactability_FeralDruid_AshamanesBite",
					["TX"] = "The imp has very sharp claws which can rip open flesh and sinew very easily.",
				},
				["v"] = 1,
			},
			["links"] = {
				["Avelock-ArgentDawn_Tarkin"] = 1,
			},
		},
		["1206222123bJn4F"] = {
			["data"] = {
				["IC"] = "Warlock_Summon_DoomGuard",
				["read"] = true,
				["NH"] = "ff0b00",
				["TX"] = "Korvok darkened the skies during the war of the ancients and hunted fleeing nightelves with glee. Gorging on their flesh and blood it absorbed and accumulated what little magical energies they had within them. After thousands of victims, Korvok grew powerful enough to overthrow his master Mephistroth and roamed Azeroth terrorising anyone who happened to come across his path.\n\nThis went on until the demon came across a nightelf called Celestia who wielded an enchanted spear called Ascalon. They battled for days and finally Celestia plunged her spear into the demon's heart, destroying his body, but not his spirit. The demon's incorporeal form travelled for millenia in the Twisting Nether until his body was reformed and sent to invade Azeroth once again during the Legion Invasion.\n\nKorvok is an extremely powerful demon which very rarely seen around Aros. Requiring all his power to control him, Aros is usually unable to attack or otherwise defend himself while controlling this being of demonic destruction.",
				["BK"] = 1,
				["NA"] = "Korvok",
				["TI"] = "Elf-gorger",
				["v"] = 4,
			},
			["PE"] = {
				["1"] = {
					["AC"] = true,
					["TI"] = "Level 6",
					["TX"] = "This demon is exceedingly powerful and can only be controlled by exerting the summoner's whole will. The warlock cannot take any actions while this demon is active.",
					["IC"] = "Achievement_PVP_P_14",
				},
				["3"] = {
					["AC"] = true,
					["TI"] = "Winged",
					["TX"] = "The demon has huge leathery wings with which he can remain airborne.",
					["IC"] = "Ability_DemonHunter_SpecDPS",
				},
				["2"] = {
					["AC"] = true,
					["TI"] = "Disruptive Aura",
					["TX"] = "The demon emanates a mystical aura which distorts all spellcasting in the vicinity.",
					["IC"] = "Ability_BossDarkVindicator_AuraofOppression",
				},
				["5"] = {
					["AC"] = true,
					["TI"] = "Expert Spellcasting",
					["TX"] = "This demon excels at spellcasting and is able to cast the foulest and most advanced spells.",
