					["TX"] = "((WIP: Full description coming soon... On an RP Addon near you.))\n\nThe man walks with a naturally straight, albeit relaxed posture. His height sends him within the average range among human men. Days of being lashed by sunlight would be the unmistakeable source of his tanned skin, with the coarse surface of his hands and the natural bulk and lightly outlined muscularture of his body being indicative of an upbringing marked by manual labor.\n\nHis healthy strands of blonde hair are often tied into a tail in recent times. When his face is shaven clean, his features would place him among other men in their mid to late twenties.\n\nUpon the center of his back on his spine, is a crude tattoo in solid black ink, depicting a skull at the center between his shoulderblades, with the legs of a spider sticking from the roof of its mouth. It appears inherently tribal in its design.\n\nHis body is not bereft of scars. Aside from the small cuts scattered across his hands, as well as a fresh long scar across his left bicep, there are several scars from gunshot wounds laid across his form. One located just below the left front of his ribs, as well as another between the right side of his ribs, both with exit wounds. Another set on his lower right back and in his left thigh are without an exit wound.",
				},
