						["TI"] = "Cologne",
						["IC"] = "INV_ValentineCologneBottle",
						["TX"] = "A fragrance of cologne seeps the nostrils far-off the man; one admirable keep, that serves sullied to distract another most constant sense of smell; for Leopoldo is a smoker, such essence at clear.",
