			["link"] = {
				["Leopoldo-ArgentDawn"] = 1,
			},
			["about"] = {
				["BK"] = 1,
				["T3"] = {
					["PH"] = {
						["TX"] = "Leopoldo Martinez stands off as wonted stock; if not a bit withdrawn. The man, in late twenties to the blossom and pruning of true adulthood has only just begun the grim wrinkling with a limited furrowing making what once was, youthly sleekness; not entirely devoid of scruples. The green piercing eyes gander with that most inexpressible gleam to them; interpretable as one of either smug intellect, or some uncommunicative learning disorder. Often and most; does the man come upon the daily personage as a loose fellow; with hair that of a pale brown; not devoid of its vanity, to crop short its sides, maintaining a lengthiness above the scalp. Of face; Leopoldo sports a long stubble of beard, mayhaps a week old, of which the hairlines develop, thickening to long sight; yet cannot seem to waxen into a thick mane; to ever be a cub amongst lions.\n\nIn the eyes, there does the soul mirror; with Leopoldo Martinez a wry unenthusiastic constant; never energized, and at the appeal of laziness; to void from work and sweat. His hands shrewdly dig characteristically deep into his pockets in most moments, whilst a voice says blankly, his linear way with words uttered, with very seldom giving change to the pitch of his voice.\n\nTo they who are wary; sharp-minded or simply of prodigious and talented perception; there may innermost, be a vestige of some brains therein Leopoldo Martinez, a sharpness of the acidulated mind, he hides with undeveloped; relaxed non-care. Perhaps even a hidden potential to overcome the self.",
						["BK"] = 1,
					},
					["PS"] = {
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "Leopoldo Martinez hails from the old Lordaeron blood, whose inheritance was made to break through the tragedy of its end times. When his wellspring met demise; his father through the cruelty of the Undead Scourge, and his mother through wind and weather in the rush and adrenaline to escape with her offspring; Leopoldo was made to live with his uncle in Menethil Harbour, at this; his gradual descent southbound, apprenticing as a carpenter.\n\nBy the end of adolescence; nearly in his twenties, a boy of mind still; the undeveloped youth would see the last vestiges of family fade and dissipate at the hour of the cataclysm; when the dragon bathed comradery in wrathful fires. With no family left, the boy stepped by each toe for the last human kingdom left to prosper from his old world, surviving village to village on a scrap; menial jobs for a loaf of bread and a roof by night.\n\nArrival in Stormwind City; the boy became a man; used to a wastrel’s life; a vagrant with little acknowledgement to the rules. Leopoldo became a pickpocket, from small-time thievery to the composure of organized crime.",
						["BK"] = 1,
					},
				},
				["TE"] = 3,
				["v"] = 10,
			},
