					["TX"] = "Eadroma is a study in practicality and sparseness. Her clothes are, for the most part, thick and lacking in ornamentation, and utterly unremarkable. Her hair is cut incredibly short around her head so as to not get in her way, and while there is a sword at her hip, the grip is similarly devoid of ornamentation, and while well-maintained, has no aesthetic value. Her face is sharp and somewhat gaunt, with a scar on her right cheek that looks as though it came from a burn. The only things on her person that seem of aesthetic value are a pair of ear studs.\n\nShe carries herself with the same practical, straightforward attitude, seemingly very focused in her walking, usually accompanied by a floating book, a quill that moves of its own accord writing as she speaks. The only part of her that does not seem focused on whatever her task at hand seems to be are her eyes, constantly darting around from new impression to new impression, taking in the sights around her and betraying an innate curiosity.",
