						["AC"] = true,
						["TI"] = "Loose & Casual",
						["TX"] = "Loosely fitted would best describe this mans attire. Well kept, but he's not a fan of anything too confining.",
						["IC"] = "INV_Chest_Cloth_PVPMage_G_01",
					},
					["3"] = {
