				["v"] = 13,
			},
			["about"] = {
				["T1"] = {
					["TX"] = " His raven hair flowed in an untamed manner down to his shoulders. A controlled chaos that was tamed and introduced order by a habitual rake through them with his digits. The sheen in his mane taking form in a scent of mint whenever you were close to him.\n\nHis defined jawline was trimmed up with his well tended to five o'clock shadow complimenting his moustache. Adding a rugged finish to otherwise unmarred facial features. A thick eyepatch covered his right eye, while his left eye with hazel warmth painted on, danced along with whatever emotion he might be showing for you. \n\nHis lips dabbled in warmth most of the time, a lazy smile or a half-baked grin without much meaning. On occation though, they tended to slide into a very toothy wolfish grin, and that's when his hazel eye woke and started judging your place infront of him.\n\nA broad and tall man, and though his gait most of the time was lacking in dignity, his toned form told you a story of the total opposite being very possible. An iron fist within a silken glove. \n\nHis voice on the other hand was not lacking in firmness. Clear set and with a point to be told. Albeit his unorthodox accent, when he spoke you were compelled to listen, whether it be because of the low rumbling tone or the way he crafted his words together, or both. Perhaps it was just the accent? \n\nHis clothes were usually loosely fitted, not confining or binding. A testament to the mans usual take on life. A clean shirt with a leather tunic on top, silkish slightly baggy pants tied firmly by a belt. The widebrimmed sailorboots that had been his for years and went through many a cobbler for repairs.",
