						["TI"] = "Feather Trinkets",
						["TX"] = "Softer feathers are donned aross parts of his armour, mainly around his scarf, his wrists and his belt. He also has one braided into a rat's tail of his hair, hanging down on the left side.\n",
						["IC"] = "INV_Feather_15",
