				["T3"] = {
					["PH"] = {
						["IC"] = "Ability_Monk_TigersLust",
						["BK"] = 1,
						["TX"] = "Qasim stands below the average height of a human male. His build is slender, his legs long, giving the optical illusion of him being taller than he is.\n\nUsually seen wearing a scarf that covers up the features seen from his nose and down, you can always see his golden brown eyes peeking out from beneath a pair of straight, neat-looking eyebrows. His skin being of the darker tones, and his trimmed hair an onyx black colour with hints of dark brown effects in it. A thin braid reaches down from the left side of his hair, to his elbow-height, with a red feather neatly wrapped into it.\n\nWould the scarf be removed, he'd reveal a pair of rounded lips with a cupid's bow, usually curled up in a worried expression, was it not for the crooked scar reaching from the corner of his right lip to the center of his cheek. A permanent grin, one might say.\n\n\nYIKES! Does he change.\n\nA worgen of larger size, reaching 245cm (8') with ease, his torso wide and heavy, carrying a lot of physical power to it. A wall of brutish force, one could say. His fur a darker brown, coating his entire body and face, his mane a tone closer to black itself. Fangs pop out from the sides of his snout, sometimes causing him to drool due to being incapable of shutting his mouth properly. Hanging from a thicker braid in his mane is a red feather, a neat trinket he keeps with him at all time.\n\nHis eyes have a slight glow to them, looking more gold than brown, and along the right side of his snout, a long scar reaches across to below his eye.\n\n\nCURRENT REFERENCE: http://imgur.com/ZEEbD3t\n(Thanks to my friend)\n",
