						["TX"] = "A muscular man in his mid forties, Bishop keeps himself in shape by excersising regularly.\n\nThere are a few notable scars around his body, which seem to have come from tavern brawls rather than any wars or such.\n\nHe is not the cleanest man, his hair is somewhat greasy and his whole person is a bit unkept. But some effort is made, at times.",
