					["PS"] = {
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "Born in Elwynn Forest as a farmer, Bishop has had a simple life. He participated in the campaign against the bandits of Elwynn where he gained some insight to sword play.\n\nThe Stormwind kingdom has not been kind to it's farmers in the past, which is why Bishop has grown a notable distaste towards nobles and rich folk. Seeing them as thieves who oppress the less fortunate, he has even grown to sympathize the Defias Brotherhood, understanding their struggles.\n\nNowadays he has taken up traveling, trying to make ends meet since farming is not quite doing it.",
