			["about"] = {
				["T3"] = {
					["PH"] = {
						["IC"] = "INV_Misc_FireDancer_01",
						["BK"] = 1,
						["TX"] = "Le-Ling, though well traveled, still maintains a lot of her beauty and a body crafted through meditation, training with the elements and a strict, nutritional diet. Her mother, a geomancer and alchemist/brewer, made sure her daughter knew how to keep herself in shape.\nAnd it shows. The girl's hair, ginger as her fur, dance to the breeze like wildfire. Her eyes, deep green like a stream in the Jade Forest, shimmer with curiosity. Her fur is said to be softer to the touch than a cloud on a summer breeze. Still, the muscles underneath would put a mountain in shame.\nFirm, full breasts, followed by a slim, toned waist, trained daily, would give the girl a very proud stance. Her powerfully thighs and a bubbly butt scultped by daily squats, would allow her to move nimbly even in armour. Oddly enough, her playfull tail seems to have a mind of it's own and stick out as much as possible.\nIf one was to touch the girl, without the guise of armor and fabrics, one would easily find their fingers following toned muscles, bumping from under her soft, ginger fur, and could easily come to the assumption, that Le-Ling gives a new meaning to the word curvy. There are enough softer spots among the muscles, she is a Pandaren, though most of her softness seems to gather at her chest. ",
					},
					["PS"] = {
						["IC"] = "Ability_Monk_DomeOfMist",
						["BK"] = 1,
						["TX"] = "There are many things one could say about Le-Ling. Though once a quiet and collected cub, studing with her mother and working in her shop, her training as a monk taught her many things of the way of life, and her travels hardened her point of view. \nThe first thing one might find in Le-Ling, is a sober expression. For a daughter of a Pandaren family, she seems to avoid drinks, and favor meditation a lot more. Quick to offer a polite smile, but slow to trust and follow anymore, she favors the collection of knowledge and shrewed preparation. \nShe is a firm believer of Huojin, and would rather act than remain passive. But having paid the price of being carried away, she is now driving herself to be ever prepared, ever perfected, and ever ready to make snap, but accurate choices. ",
					},
