						["AC"] = true,
						["TI"] = "Facial features",
						["TX"] = "Vibrant red hair would engulf a rather sharp and elegant face, still clinging to the youth of a Pandaren in her prime. A light coat of white fur, hardly enough to cover any blushing or facial expression, would be found around a pair of bright, turquoise eyes. She is observing the world with interest, hiding a small, yet satisfied smile under a jittering snout, picking the scents of her surroundings.",
