					["2"] = {
						["AC"] = true,
						["TI"] = "Body",
						["TX"] = "This Pandaren appears to be an example of her people in her prime. Standing proud, with held often held high, her body has been shaped by training and a life of traveling. A rather muscular result, breaking stone and sustaining gales, her body still possess a full chest and childbirthing hips, common among her people. Her ginger fur is kept short and well groomed, as much as possible. Only her tail can be seen dancing from time to time, betraying a hidden playfullness.",
