			["about"] = {
				["read"] = true,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{p:c}A leanly muscular and tall man. His relatively long jetblack hair carries a light scent of mint, which one might notice if they were standing close enough to him. His five o'clock shadow and moustache seem to be well taken care of finishing his rugged but smooth look.\n\nA thick eyepatch covers his right eye, while his hazelnut gaze peered at you from his left, dancing along whatever emotion he might be displaying. A black rose tattoo decorates the side of his neck, struck across by a faded scar.\n\nHe usually wears a set of clean clothes, slightly baggy silkish pants, weathered thick boots well known to be worn by sailors. A clean shirt with a leather tunic on top, \n\nThe tanning on his skin hints that he might be from the southern parts of Azeroth as does his rather unorthodox accent, his voice is low and pleasantly vibrating. His posture is usually quite lazy, he enjoys walking around with his hands in his pockets, but his toned body hints at possibility of the complete opposite should it be needed.{/p}",
