					["1"] = {
						["AC"] = true,
						["TI"] = "Appearance",
						["IC"] = "Garrison_Building_SalvageYard",
						["TX"] = "\nAlong with her lantern, she has a very small dagger at the side of her belt.  She tries to look her best by always making sure her hair looks neat and that her nails as well always look as clean as they can. \n\nHer hair is about shoulder length, her haircolor is that of a cold ashy blond color. Her skin is very pale and goes well with her over all, pale and dusty apperance. ",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Very kind",
						["IC"] = "Spell_Nature_HeavyPolymorph2",
						["TX"] = "She is a very kind and forgiving person. She will always welcome people into her surroundings and she will do her best to make everyone feel warm and loved.\n\nNina looks very innocent and kind, when she smiles she would often get rose-like cheeks. ",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Tabard",
						["TX"] = "She wears her company's tabard when she is out on work. During work she wears regular clothing, with a somewhat tight fight. Allowing a good view of her petite and pearshaped body. ",
						["IC"] = "INV_Misc_Tabard_WildHammerClan",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Lantern",
						["IC"] = "INV_Misc_Lantern_01",
						["TX"] = "At the darkest hours, she can be seen holding a lantern. She usually has it sitting next to her as she reads or as she wanders around the city.",
					},
				},
				["ST"] = {
					["1"] = 2,
