		["1215205245bXiiD"] = {
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Personality of a Shield",
						["IC"] = "INV_Shield_04",
						["TX"] = "Most people that engage in conversation with Thealnis will notice her tendency to remain blank-faced and neutral to most social situtations. She has an air of discipline about her which prevents her from being casual.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Armed",
						["IC"] = "INV_OrderHall_ArmamentPurple",
						["TX"] = "Thealnis goes nowhere without her trusty weaponry and set of armor. She usually bears blunt and non-lethal weaponry in majorly populated areas however.\n\nShe is proficient in the following:\n- Mail Armor\n- Polearms\n- Dual Wielded / Single Wielded daggers\n- Bows / Crossbows",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Keen Senses",
						["IC"] = "Ability_Hunter_SilentHunter",
						["TX"] = "Often hearing things that others might ignore or downright not perceive, Thealnis is adept at finding others, whilst they are nearby. Additionally, her eyes are well-trained and pick up on subtle mannerisms with ease.\n",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Scent of Berries",
						["IC"] = "INV_Misc_Food_Vendor_Witchberries",
						["TX"] = "Rubbing her skin down with oils, Thealnis manages to perpetually smell pleasantly of fresh berries. Most of which are native to Moonglade.",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Teal Tinge",
						["IC"] = "Item_moonclothbolt",
						["TX"] = "Altough her hair consist mostly of white locks, layering freely on one another, Thealnis' hair bears a few strands of teal, giving it a very slight tinge to it. ",
					},
				},
				["ST"] = {
					["1"] = 2,
					["3"] = 3,
					["2"] = 1,
					["5"] = 4,
					["4"] = 1,
					["6"] = 1,
				},
				["v"] = 61,
			},
			["link"] = {
				["Thealnis-ArgentDawn"] = 1,
			},
			["about"] = {
				["T2"] = {
					{
						["TX"] = "Kaldorei Heritage:\n\nIt does not take an expert to note the clear Kaldorei genes which Thealnis carries. An impeccable specimen, with pure, white and gleaming orbs for eyes and fresh, lush hair. In among the silken white strands, a tinge of teal shines through, giving it a pleasant, natural look. With incredible volume and shine, her hair is both pleasant to behold and to the touch. \n\nThe features upon Thealnis' face are generally smaller and more rounded, almost hinting at half-breeding, however this is far from the truth. Both of her parents being of repute within the Kaldorei society.\n\nHer athletic, yet slim, body allows for a bit of curviture, her bust being moderate and not excessive. Her skin is well nourished and seemingly without any blemishes. Running a careful finger across it one would be reminded of the softest cotton.\n\nBeing a smaller elf than most, Thealnis has to rely on dexterity rather than strength. This is apparent in most of her artforms, be it combat oriented or simply free-running. Standing half a foot below the average Kaldorei male, she relies on other techniques to come across as imposing.\n\n(Link for facial features: tinyurl.com/zovfcw3)",
						["BK"] = 3,
						["IC"] = "Spell_Shadow_MindShear",
					}, -- [1]
					{
						["TX"] = "Shield-Like Personality:\n\nBlank. That is the first thing that comes to mind, when one reminds oneself of Thealnis. She is incredibly gifted at maintaining what is commonly referred to as a \"resting bitch-face\", which is attributed to her extensive disciplinary training, granted by her millennia of service to the Night Elven army of Sentinels.\n\nHowever, there is another side to her. Incredibly compassionate and caring, even protective, she is a lovely person to be acquainted to, once you breach the facade which she keeps. Almost akin to a motherly figure or an older sister.",
						["BK"] = 3,
						["IC"] = "INV_Shield_04",
					}, -- [2]
					{
						["TX"] = "Proficient with Polearms:\n\nAdept from a young age, with the use of polearms and staves, Thealnis has always had a way with blocking strikes of more efficient weaponry, by simply redirecting them. Similar to the monks of Pandaria, Thealnis is capable of taking a bo-staff into the fight against an Orc grunt, and emerge victorious.\n\nBy utilizing the change of 'cadence' she manages to whip weaponry out of the hands of foes, with expert ease.\n\n(For reference, Jake Mace on Youtube)",
						["BK"] = 3,
						["IC"] = "Ability_IronMaidens_IronShot",
					}, -- [3]
					{
						["TX"] = "Unique Archery Style:\n\nMost bowmen and women find that a steady stance and proper aim are suited for the use of bows. Thealnis, however, remains in motion during use of bows and fires from a sense of instinct. Hitting most of her targets, with incredibly precision, with a lack of proper aim.\n\nTo allow this, she does not carry her arrows in a quiver, but rather sets them under her fingers and slips them into a position to fire when needed.\n\n(For reference, Lars Andersen on Youtube)",
						["BK"] = 3,
						["IC"] = "Ability_Hunter_RunningShot",
					}, -- [4]
					{
						["TX"] = "Capable Physician:\n\nHaving seen many battles in the past and being required to aid an ailing sister-in-arms at times, Thealnis has garnered an extensive knowledge of how to properly bandage, cauterize and disinfect wounds. She knows how to set bones into place without causing intense pain and can, through medicinal aid, numb pains before stitching up wounds.",
						["BK"] = 3,
						["IC"] = "INV_FIRST_AID_70_Splint",
					}, -- [5]
				},
