						["IC"] = "Achievement_Character_Gnome_Female",
						["TX"] = "Cathode has a very rough, boyish look. Her left ear is damaged with a section of material missing in the middle. She does not look like she gets much sleep.\n\nThis particular Gnome is considerably burly and broad, but is no taller than average.\n\nhttp://tinyurl.com/Cathode001",
