			},
			["about"] = {
				["BK"] = 18,
				["T3"] = {
					["PH"] = {
						["TX"] = "Cathode Lance Rivetshot is a military-fit female Gnome with a sturdy structure and a boyish face, plain and tomboyish in appearance. Very little is soft about her facial features as she has a stubby nose that comes to a blunt point, thin lips and narrow eyebrows that start darker in the closer they are the inner side, as well as a squared jaw and a wider chin than what most other females of her kin have. Her skin is rough and mostly unblemished, it hangs loosely under her eyes as of she had not slept a wink since Gnomeregan. She keeps her hair short and sensible, but it always seems to look scruffy.\n\nShe has broader than average shoulders with practically nothing that resembles a curve above or below. Her musculature is well honed and passionately defined by a constant, relentless routine achieved with almost mechanically meticulous efficiency. She's as practically muscular as a Gnome could be without looking freakish or being impeding to her lifestyle. Her apparent constitution is usually concealed by a knee length coat.\n\nThe left ear is missing a section from the very middle, a triangle shape of material removed with two defined, clean dips. She has several dull, metal teeth at the front of her mouth that are easily seen when she talks or smiles, but she actively tries not to let them show. Each of her arms are coated with sleeves of ink black tattoos depicting interlocking cogs and gears, reaching from her shoulder to her hands, with rivet and bolt patterns upon her knuckles, but the right sleeve stops just before the elbow, as the tattoo is unfinished. There are a few light scars that run up her neck and onto her jawline, whitened and difficult to see without being up close.\n\n--- Current References\nhttp://tinyurl.com/CathyRef3",
						["BK"] = 6,
					},
					["PS"] = {
						["TX"] = "Positive Traits:\nModest, Industrious, Amiable.\n\nNegative Traits:\nStubborn, Restless, Martyristic",
						["BK"] = 9,
					},
					["HI"] = {
						["TX"] = "Rumours:\n\nCathode has a poor reputation and is marked as a \"coward that got off easy.\" She's often given trouble by soldiers and guardsmen alike.\n\nCathode has apparently been released from the stockades for a horrendous crime in the last couple of years, somehow evading a harsh sentence.\n\nThis individual apparently spends a lot of time in the park as well as the cemetery in Stormwind after dark, though nobody knows why.",
						["BK"] = 6,
					},
