			["about"] = {
				["T2"] = {
					{
						["TX"] = "History\n\nAnna was actually born into a quite a wealthy family, but ended up falling in with a different type of crowd. Instead of fancy dinners and parties, it was slums, low quality taverns and cheap drinks for her. Unlike others, she would wear no dresses, no fancy gowns, but subtle ragged tunics and hoods, to hide her face.\nAlthough she doesn't much care for her past, it had it's benefits. Noone would dare to accuse a highborn of anything and she also learned fencing from a young age.",
						["BK"] = 1,
						["IC"] = "INV_Misc_Book_08",
					}, -- [1]
					{
						["TX"] = "Fighting style\n\nBecause of her history with fencing, her fighting style is not something you'd expect from a (most of the time) drunken pickpocket hanging around Old Town. Her fighting style is very graceful.",
						["BK"] = 1,
						["IC"] = "INV_Sword_1H_PanStart_A_01",
					}, -- [2]
					{
						["TX"] = "                                  Personality\n\n\nAnna is wild, doesn't care about rules, though she tries her hardest not to get in trouble with the law (She always ends up getting in trouble) Other than common the only language she seems to speak is drinks. Buy her one and she'll be your best friend for the evening, and forget all about you tomorrow.\nShe has an -extremely- short temper.",
