				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "Loenara is a young and fierce woman, she was born into the rich Darkgaze family in gilneas. Having a high level of education her father was a bank owner and her mother helped him in his work. She and her sister Arina were not allowed outside untill one day they both sneaked out. This became a tragedy for when they stepped outside of the gates to the forest they were attacked by a Worgen. This became fatal for the young Arina for she was killed during this encounter. The young Loenara watched as the worgen attacked her sister and tried to defend her with nothing more than a sharp stick. This is where Loenara got bitten, she couldn't fight anymore and watched as the worgen killed her sister, she herself, changing.\n\nLoenara passed out and was later found with her dead sister. her parents blamed everything on her and told her to leave. Loenara  left into the woods to never see her parents again. This is where she lived and enhanced her swordfighting skills. She eventually was found by and old man who took her to his home in stormwind, when he passed away a year later Loenara swore that she would also care for those in need. Using violence if she has too.\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}",
