						["TX"] = "Miss Halock is a wretched figure of a worgen. Gaunt and haggard. Hunched and limping. Rotting fangs and ears filled with mold. Only her eyes, burning with soul-fire in the middle of her grey pelt, seem to have a will to go on. \n\nHer right cheek has been torn apart. Some attempt to restore it has been made, but tattered gaps are still visible in her flesh. Her right eyesocket, too, has a large gash running across it.\n\nHer belt dangles with bones, chains, phials, pouches and other small, loathesome accoutrements. An abomination's cleaver is hooked to one hip, and an iron lantern to the other.\n\nShe smells like a dead animal, but the horrible stench has many others hidden beneath it -- fresh herbs. Old blood. Dried flowers. Salty fish oil. Acrid alchemical mixtures.\n\n\n(http://tinyurl.com/KithArt)",
