					["TX"] = "Piper is at an average height for a human woman, standing at a 5\"7 with a slim figure. She's not particularly muscular or curvy, and has rather skinny arms and legs and a toned stomach. Her pale skin tone contrasts strongly to the bright red shade of hair, which is messily tied back into a high ponytail.\n\nHer facial features are small and simple - a small, thin nose, thin nude lips and high cheekbones. Her eyes are almond shaped, their colour a mahogany brown that appears reddish. Along the pale complexion of her face, many freckles are dotted across the bridge of her nose and over her cheeks. Freckles can be found all over her body, and are more prominent depending on the amount of time spent in the sun. \n\nA silver stud is pierced through the tail of her left eyebrow, and another stud piercing can be seen on the left side of her nose. Often tucked away under her shirt, she'd wear a old gold coin attached to a bronze chain.\n\nOn the left side of Piper's neck some faint burn scars would be visible, that trail all the way down to her collar bone. Piper's body would also be littered with other scars, mostly hidden under clothing.",
