						["IC"] = "Ability_Warrior_StrengthOfArms",
						["BK"] = 1,
						["TX"] = "Before you stands a man that one could only describe as mysterious, however paradoxically common he may seem. His bright, blue eyes betray a calm demeanor and, along with his charming smile, complement his seemingly childish and joyful nature. The man towers at 6'1\", his athletic frame portraying him an individual used to labour, or perhaps one overly concerned with his image. His face, always bearing a smile, is void of scars and looks clean and consistent with his personality, that of a man who seems uninstructed in the art of war. His hair is short, always combed and parted from the middle to the sides, a longer strand ever sliding on his face and slightly covering his left eye. Whether this is an artistic choice, one cannot tell. His beard, shaved in a complicated, exquisite style, seems freshly trimmed and tidy.\n\nHis manner of speech and acting would best describe him as a jester, often seen conjuring petty tricks to please his peers. If spoken to, one would immediately notice his habit of gesticulating whilst speaking, often making grand gestures as if to either amuse or attract people.\n\nHis usual attire, however, would seldom attract anyone's attention. Simple and dull, often described as mundane by strangers, his clothes seem fashioned out of cotton and wool. Most of the time, his belt is decorated with a few pouches, contents of which undiscernable from a distance. On his right hand, he bears a small, utterly unimpressive, silver ring. Around his neck, he wears a hourglass shaped pendant.",
