						["TI"] = "Appearance",
						["TX"] = "Cornelia is rather pretty, her skin peachy with rosy cheeks and lips. A few freckles goes over her little nose. Her thick, golden brown hair reaches down to her slender waist, usually up in a ponytail, and her bright blue eyes really stands out.",
