			},
			["about"] = {
				["v"] = 12,
				["BK"] = 4,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PVPFrame\\Icons\\prestige-icon-4-5:128:128}\n{col:fff3d9}Cornelia was born in Redridge. An only child with very generous and supportive parents, but she did get kind of lonely. Working at the local stables along with her father, she had met many curious travellers that peaked her interest about the world. She often went on her own adventures too, but never ventured outside of the area. She'd always play games by herself, usually stacking up old cans and already broken bottles along the fences and shoot them with her toy bow. That interest stayed as she grew up to be very skilled at hitting things at range. When she was old enough, she got herself a crossbow, and failed miserably to even load it the first month. But she got the hang of it and nearly mastered it in her own method of shooting before she set off with the local hunter for her first real experience. She loved it and couldn't dream of doing something else. Every part of an animal was of use to people, and that's really what she wanted to be - of use. She learned how to flay the skin and salvage as much fur as possible. How to cut tusks off wild boars and filet meat. She started out by helping out her locals, before she left her simple life and ventured off to the bigger world to be able to assist while making some coin.{/col}",
