					["TX"] = "                                                     Benhart Blackmane \n\nBenhart was born in Gilneas as a poor boy, hes parents left him when he was 5 and he had to live in the streets of Gilneas City. he survived by stealing and pickpocketing. when he beacame older he joined a group of thieves, here he learned about stealth and combat. When Benhart became 18 he joined the Gilnean army as a scout, he was on lookout for people trying to attack Gilneas.\n\n                                                    The Curse \nwhen Benhart was 24 the Worgen curse hit Gilneas, Benhart was now a Warrior of Gilneas. Benhart was the last remaining person in his group when he got attacked by Worgens, he escaped the worgens but got cursed. Not long after he gained his sanity back the Forsaken attacked Gilneas, he was stil in the Gilnean army so he had to defend the lands from the Forsaken. After a long battle  Benhart got captured by the Forsaken, he was in a prison camp and waited to be executed, but he managed to escape the Forsaken and got help from the Night elves. \n\n                                                       \n\n{link*http://imgur.com/a/P9U65*Art of Benhart}\n\n\n.{img:Interface\\Pictures\\artifactbook-rogue-cover:256:256}",
