				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Appearance",
						["TX"] = "A blemish, scar free visage is displayed on Lexia, her face being well toned, red cheeks, crimson lips and a piercing emerald coloured gaze fixated on those around her. Lexia's face would display a cute and attractive look.\n\nLexia's golden blonde locks hang freely down the back of her head onto her back. Fresh and silky clean. Her hair bright, glowing from the reflection of the blazing sun.\n\nLexia keeps herself fit and healthy, her figure displaying this. Her slim/fit figure quite obvious as she walks around. Her arms being smooth and slender, along with her legs also. Tiny hands planted on the end of her slender arms, along with her reasonably tiny digits also, each nail of each digit coloured nicely in purple. \n\nShe doesn't seem to wear much make-up at all, prefering to show her neutral beauty. Also showing that, when first met with, her presence is calm and soothing, wonderful to be around.",
						["IC"] = "Achievement_Character_Human_Female",
					},
					["3"] = {
						["IC"] = "INV_Misc_Bag_08",
						["TI"] = "Satchel",
						["TX"] = "Lexia holds a linen black satchel, the leather strap, running across her shoulder as she wears it. It also adornes her intials in large golden, fancy writing across the front of it: L.T.\n\nThe bag is generally quite big, usually sat at her hip as if looked at carefully, it'd hold many books. Her love of books and reading being easy to tell.",
						["AC"] = true,
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Lexia's Book",
						["TX"] = "Lexia's book is a no-go zone. Being made out of fine materials such as hard leather, adorned in purple gems along the front and back of the book, also with a baby-blue coloured ribbon stuck onto the side of the book, creating a fancy loop on the side as the wind blows it around nicely.\n\nShe holds her very most, darkest and deepest secrets in this book, along with many over things such as motivational sayings.\n\nThe book has her intials written big on the front in a bold dark blue colour, placed on the purple leather of the book, her intials being: L.T",
						["IC"] = "INV_Misc_Book_05",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Injuries",
						["TX"] = "-None",
						["IC"] = "70_inscription_vantus_rune_nightmare",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Jewellery & Tattoos",
						["TX"] = "-Lexia has a very nice, golden chain necklace that loops around her neck loosely. It shines bright with her intials carved into the golden material: L.T\n\n-Lexia adornes a silver ring on her right middle finger. It has the name, Cloud, written across it, coloured in with a dark blue ink, the silver ring quite shiny also. \n\n-Lexia has a tattoo on the right side of her waist, leading down her thigh: A picture of a grey owl perched on a wooden structure. The tattoo ends just above the knee.",
						["IC"] = "70_inscription_steamy_romance_novel_kit",
					},
				},
				["v"] = 38,
			},
			["time"] = 1499032712,
			["zone"] = "Stormwind City - Mage Quarter",
			["about"] = {
				["T1"] = {
					["TX"] = "{h2}{col:d1baff}Lexia Tibble{/col}{/h2}\n\n{col:ffffff}Lexia Tibble was born and brought up in, the once wonderful city, Lordaeron. She was brought up by both her parents, which where her sister accompanied her: Alysia Tibble. Lexia and Alysia were really close together, considering they were only three years apart from one another, they knew what each other were going through, during their times of mixed emotions. During Lexia's time of being a little girl, she was an aspiring priestess, also taking an admiration for the Quel'Dorei and Kal'Dorei, learning both their languages over time also.\n\nGenerally, Lexia is a calm and mature lady. She is well spoken and is neat and tidy all of the time. She is very clean and has a very big interest in reading, collecting many books. Her presence is calm and comforting when people approach her. Lexia also has a very big interest in animals! Mainly birds. But her favourite animal being an owl. She even has a tattoo of one across the right side of her hip. Lexia's clothes would be of a good fashion and state. Looked after most the time and cleaned regularly. It'd also to notice that Lexia has gone to learn how to become some sort of Tailor. Herself creating many clothes of her own and others.\n{img:Interface\\ACHIEVEMENTFRAME\\UI-Achievement-Bling:128:128}\n\n{/col}",
