			},
			["about"] = {
				["BK"] = 1,
				["T3"] = {
					["PH"] = {
						["IC"] = "Achievement_Character_Draenei_Female",
						["BK"] = 1,
						["TX"] = "Laizen stands tall, at least for the majority of races. However it is quite average for her own kin. The horns of this woman curve towards the back of her head, unblemished and cared for, evidently.\n\nHer facial features begin with a pair of anxious seeming white eyes, a certain glow hanging around them, whilst the skin remains smooth and undamaged in the slightest. Showing how she has kept herself mostly out of harm's way, at least. A pair of defined cheekbones cause a slight shadow upon her jawline, that's quite soft in reality. Added with thin lips that hold an anxious smile most of the time.\n\nThe ivory looking locks upon her head remain clean and hang down the left side of her head, fringe barely sweeped out of the way of her left eye, in fact it sometimes covers the vision of that side of her face. Dependant on whether she's had a haircut lately, although the length of it manages to travel halfway down her back in a cascade of white upon the light blue skin.\n\nTendrils adorn her neckline alike any other Draenei, albeit without any jewellery upon them however. Being rather short too.\n\nMoving to her bodily physique, she's rather toned. Showing a training regime that does work for her athletic build, causing muscular definition across her form yet not sacrificing an overall feminine appearence. The only lasting mark being a scar running across her stomach diagonally. Beginning from the ribs of her right side down to her left hip almost.\n\nGetting to her hooves, they do seem like they are used for a lot of travelling. However every so often are tended to, to ensure no lasting damage occurs. Making sure they're neat and tidy!\n\nA lengthy tail hangs from this Draenei, trailing down her legs until tapping the floor, almost. Although when in her armour it's usually coated in a series of crystal plating born of a white colour, allowing for movement yet protection.",
