				["T3"] = {
					["PH"] = {
						["TX"] = "{col:1dff3b}Narin is a sprightly, animated elf who walks in chipper steps. Often, she wears a pleasant, idle smirk on her lips as her curious eyes jolt around, rarely stopping on anyone or anything for longer than a brief twinkle. \n\nHer eyes are big and curious, her lips a pleasantly curved pout unless she is smiling, which she usually is! Narin's visage is almost perpetually cheeky and she usually ties her blueberry locks into a long braid, then often pulls and fiddles with in her vacant thoughts. \n\nShe is control of her lithe, slender frame completely. Often times, her arms and shoulders are bared, showcasing some gentle musculature upon the bones, but not much else. Her movements have a tame, but noticeable feline quality about them, comfortably slow but, in fact, quite agile!{/col}",
