			["about"] = {
				["T1"] = {
					["TX"] = "Appearance\n\nElyon stands at an average height. Instead of a triangular form as is typical for Kaldorei males, his body takes more of a trapezoidal shape. Indeed, he seems less lean than others with a slightly bulkier appearance, perfect for the frontline and allowing durability, able to withstand a few tough hits. His muscles seem less defined but they are no doubt present, suggesting a healthy appetite- though he can by no means be considered fat. A few faded scars, here of arrow entrance wounds, there of sword slashes, cover parts of his shoulder and torso.\n\nWith a head most accurately described as triangular, he sports defined cheekbones, a Grecian nose and a slightly pointy jaw- he may not exactly be considered ugly. His face, fresh faced and careless, with pure skin and characteristic laughter lines, grant Elyon a rather friendly appearance as well as the observer an insight on his life- one mostly free of deep sorrow and personal losses. A few small, fading scars, barely visible at first glance, cover parts of it. His ears, though smooth and long, appear to have a slight tendency to droop, burn scars covering the tip of his left ear. Fairly thin, almond shaped eyes glimmer in a typical silver with thick, but comparatively short eyebrows above them. Dark blue and thick hair, untamable and messy, top off the overall youthful and cheerful appearance of the night elf.\n\n\nWeapon\n\nHis scabbard is sporting a repeating design- under a scalloped hem carved at the top of the scabbard are leaves, locked and linked together and winding down the leather, the midrib carved in but the design simple- yet pretty. The colour of the scabbard itself is a vague mauve, the hilt wrapped delicately with leather and a blue crystal quietly resting at the top.\n\nThe sword itself is pointed, and beautifully crafted- dangerously sharp. It gets slimmer towards the end, tapered, and gleams a bright silver, white in the light. The blade itself has also been engraved with a pattern. Lines criss-cross the blade like root or river systems in symmetrical design.\n\n\n\n\nFirst Glances\n\nLaughter Lines\nThe distinct laughter lines around his eyes give his face a much more friendly appearance.\n\nMithril Sword in a Leather Scabbard\nA beautiful sword, dangerously sharp, that gleams with a bright silver. Shining white in light, lines criss-cross the blade like root or river systems in symmetrical design.\n\n\nSpiked Garrote & Climbing Rope\nA spiked garrote with acidic stains appears to be attached to the outside of his cushioned purple satchel. A wrapped up climbing rope is attached to the other side.\n\n\nBelt\nAttached to his belt is a pouch with blinding powder, his coin pouch as well as a skinning knife in a leather sheath.\n\n\nMint\nFor some reason his hair usually smells like mint.\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\nContents of his satchel:\n\n-    Notebook (self-made maps and notes)\n-    Pouch with five vials (Paralytic venom, Moonwell Water, Elixir of Detect Demon, Elixir of Ogre Strength, Swiftness Potion)\n-    Silver flask with moonberry engravement\n-    Herb Pouches\n-    Matchbox\n-    Field pack (alcohol, antiseptic bandages, needle and thread, intravenous healing potion, Troll's Blood Elixir, cotton balls, cotton swabs, scalpel, scissors)\n-    A coin pouch (6 Gold)\n-    Onyx diamond, clean and cut perfect wrapped in cloth (clementine sized)\n-    Mint water\n-    Ink and feather\n-    Two Thunderhorn teeth\n",
				},
				["BK"] = 4,
				["TE"] = 1,
				["v"] = 21,
			},
		},
