						["BK"] = 1,
						["TX"] = "Head held high Essi is the epitomy of a determined shamaness, no sign of fragility in her demeanour or physique. Her skin is a sombre pale grey, hair fine, like spun glass around a head adorned with curved back horns. The horns themselves, are heavily marked, etched with exotic writing into their arching curves.  Her right eye appears slightly clouded and does not glow as bright as the other.\n\nThe tendrils behind her ears are adorned with traditional gold bands, each engraved with Draenei symbols. Around her neck is a single silver chain which loops down to a ruby of which one side is fully cut, the other uncut. A single leather cord charm bracelet is tied onto her right wrist. \n\nDepending on Essi's attire, it would at times be possible to see a tattoo across her right shoulder blade, a frail sister of fate holding a book with a flower growing up through it.\n\nA black leather pack rests comfortably across her shoulders, and a series of small pouches are buckled firmly to her belt on her left hip, alongside her formally engraved axes - a gift from an old friend.\n\n\nBackpack contents currently:\nFire-lighting flint\nWater flask\nSpices\nragged eared book\n\n\n--------------------\n\nPrimal - Apothecary - Melee\n\n(fresh scarring over right side of rib cage)",
