		["0125020712K2Vh5"] = {
			["misc"] = {
				["PE"] = {
					["1"] = {
						["IC"] = "INV_Spear_08",
						["TI"] = "''Misery'' - (Only when mounted) ",
						["TX"] = "Anora's inital weapon is in the form of a four-metre long lance. It is a truly a menacing weapon for other ounted-combatements or unfortunate souls which she chases as they flee from her or recklessly charge her. As the weapon weapon she wields is made to be leading a cavalry charge. It is clearly ment to be a weapon of shock as it would impale her opponent and throw the opponent of his or her steed killing them in the process, being quite lethal when wielded by a death knight possessing -super human- unholy strenght. \n\nUpon sight one may notice that the lance is colored in the same crimson colors with hints of unholy magic akin to the armor of it's wielder. \n\nThe material which the lance is made out of is refined saronite and is relativly renowned for being a very superior metal particulary so for weapons of war. Being both hard and rigid but also light. Thereæs some leather and cloth by the grip, to ensure a firm grip and just infront of that there's a vamplate to prevent the hand from sliding up the shaft upon impact. As the sheer kinetic impact will assuredly be massive, portraying its power as a anti-armor shock weapon.",
						["AC"] = true,
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Cold Aura",
						["TX"] = "When one is close to the Lady one may slowly begin to become colder as if the frigid wastes of Northrend was upon one, certainly this and her blood like aura is there to preserve her.",
						["IC"] = "Ability_DeathKnight_RemorselessWinters2",
					},
					["2"] = {
						["IC"] = "INV_Sword_2H_Blood_B_01",
						["TI"] = "''Sorrow''",
						["TX"] = "This death knight carries a imposing Rune blade on her back in the form of a rigid estoc crafted out of refined aronite. Giving it a formidable ability to penetrate armor through thrusts wich is amplified by the runic power of it's wielder but also unholy strenght.\n\nIt is certainly a most specialised blade as the blade is more suitable to be used to counter armoured opponents such as knights or paladins for that matter rather then to slash down a horde of murlocs.",
						["AC"] = true,
					},
				},
				["ST"] = {
					["1"] = 2,
					["3"] = 3,
					["2"] = 1,
					["5"] = 4,
					["4"] = 2,
					["6"] = 2,
				},
				["v"] = 22,
			},
			["link"] = {
				["Panzerjäger-ArgentDawn"] = 1,
			},
			["about"] = {
				["v"] = 57,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}{link*http://i.imgur.com/cbzVu2r.jpg*Lady Anoras The Sanguine}{/col}{/h1}  \n{h1:c}{link*https://hydra-media.cursecdn.com/wow.gamepedia.com/d/df/Deathcharger_TCG.jpg?version=f9d1ed2645d409ff93ce7c15647712c4*Deathcharger Xaxas}{/h1} \n\n\n{img:Interface\\LFGFRAME\\LFGIcon-IcecrownCitadel:256:256}\n\n\n{col:a31538}Anoras is a tall and imposing Arathorian woman which used to once be a stern soldier of said human nation. Her plesantly sounding voice has been transformed into a cruel and malovent tone. Her eyes now icy blue and cold as if all life were consumed and emotion. Her body is covered with scars and stabs revealing her fate, it was not kind to her, there are marks of numerous battles and eventual defeat as well.\n\nHer body remains in the state she died in. Possessing what one may call an Amazonian physique and stature.\n\n\n\n{h2:c}{col:a31538}<-- Armour -->{/h2}\n\n\n{col:a31538}She is clad in her special crafted suit of armor which is actually a more intricate alloy between Saronite and hardened Elementium. The double-layered plates cover her major areas going down to less movement restrictive armour such as saronite and elementium scale mail, but also riveted chain mail. This gives her durability and hardness including sheer resilience to melee and ranged weapons alike yet the weight and the xlunkiness of the armor is not over bearing. The armor makes her impregnable to common weapons. The armor covers most of her body, from tip to top. Saronite is known to have 1/4 of the weight of high quality steel and is very resistant to any kind of magical effects, which is aimed against it, it is also extremly hard. Elementium is also renowned for being a very dense metal and adds it's own unique strenght to the alloy, but it also makes her armor heavier then normal saronite armor. \n\n\n\n{h2:c}{link*http://i.imgur.com/WSAkHfX.png*''Misery'' - (General shape may not be 100% accurate)}{/h2}\n\n\n\n{col:a31538}The Lady's inital weapon is in the form of a four-metre long lance. It is a truly a menacing weapon for other ounted-combatements or unfortunate souls which she chases as they flee from her or recklessly charge her. As the weapon weapon she wields is made to be leading a cavalry charge. It is clearly ment to be a weapon of shock as it would impale her opponent and throw the opponent of his or her steed killing them in the process, being quite lethal when wielded by a death knight possessing -super human- unholy strenght. \n\nUpon sight one may notice that the lance is colored in the same crimson colors with hints of unholy magic akin to the armor of it's wielder. \n\nThe material which the lance is made out of is refined saronite and is relativly renowned for being a very superior metal particulary so for weapons of war. Being both hard and rigid but also light. Thereæs some leather and cloth by the grip, to ensure a firm grip and just infront of that there's a vamplate to prevent the hand from sliding up the shaft upon impact. As the sheer kinetic impact will assuredly be massive, portraying its power as a anti-armor shock weapon.\n\n\n{h2:c}{link*http://i.imgur.com/QuZZFSf.png*''Sorrow'' with a active frost rune}{/h2}\n\n\n\n{col:a31538}Sorrow is the choosen rune blade of Anoras it is a rigid and formidable estoc which is exactly 155 entimetres in lenght. It may be noted its inscribed with runic enchants it is as well crafted out of perfectly crafted saronite making out of superior quality to lesser weapons. Due to it's nature as a estoc its sole purpose is to be used against armored foes in a thrusting role because of its geometery that leaves hardly any cutting capability as a sarpened edge could simply not be ground. However it's long and promiment tip seems to be unaturally sharp and capeable of stabbing deeply into her foes, regardless of plate armor. \n\n\n\n\n\n\n\n\n",
				},
