				["T1"] = {
					["TX"] = "{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{h1:c}{col:ff4900}OOC{/col}{/h1}\n\n{h3:c}\n{link*tinyurl.com/fatmem*Reference picture}\n\n(For MRP users: tinyurl.com/fatmem)\n\nCharacter voice reference - {link*https://youtu.be/0TNHQlXvmLU?t=129*Female worgen merchants}\n\nCharacter theme - {link*https://www.youtube.com/watch?v=_3ux53bbVXs*\"Wear\" by Ken Ashcorp}\n\nVery much approachable and recruitable. Don't mind the punny TRP. This is a serious character.\n\nI'm also doing sketch commissions (Either for in-game gold or real money), both IC and OOC.  \n\nI realized that my previous profile incarnations were way too joke-oriented, and didn't really suit for serious roleplaying at all, so, I felt like doing some renovations.\n\n[WARNING: I'm Russian IRL, so, expect some heavy grammatical and punctuational errors!]\n{/h3}\n\n\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{h1:c}{col:ff0059}FACE{/col}{/h1}\n{img:Interface\\QuestionFrame\\answer-ArtifactNYI:256:128}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{h1:c}{col:ff002e}ATTIRE{/col}{/h1}\n{img:Interface\\QuestionFrame\\answer-ArtifactNYI:256:128}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n\n{h1:c}{col:ff0000}BODY{/col}{/h1}\n{img:Interface\\QuestionFrame\\answer-ArtifactNYI:256:128}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{h1:c}{col:ff2000}BEHAVIOR{/col}{/h1}\n{img:Interface\\QuestionFrame\\answer-ArtifactNYI:256:128}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{h1:c}{col:ff3000}MISC{/col}{/h1}\n{img:Interface\\QuestionFrame\\answer-ArtifactNYI:256:128}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{h1:c}{col:ff2c00}BACKGROUND{/col}{/h1}\n{img:Interface\\QuestionFrame\\answer-ArtifactNYI:256:128}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{h1:c}{col:ff2c00}{col:ff3000}STATS AND SKILLS{/col}{/h1}\n\n\n{h3:c}{col:ff2c00}STATS{/col}{/h3}\n{col:e7b879}She may have been gifted, but the said gifts have long since rotten away.{/col}\n\n{icon:Spell_Nature_Strength:25} {col:ff953f}[STRENGTH - 3]{/col}\n{col:e7b879}Garselle Appleby is definitely one of the weaker worgen around. In fact, she never really seemed to care about her physical strength. Her apathetic, cowardly character, accompanied by the constant self-indulgence and various bad habits (ranging from drug / food / coffee abuse to suicide attempts) insured the worgen's body slow descent into the valley of health issues. However, she is still fairly strong. Not strong enough to stand against a well-trained guard, but certainly stronger than most human women.{/col}\n\n{icon:Ability_DemonHunter_EyeBeam:25} {col:00ff7b}[PERCEPTION - 10]{/col}\n{col:e7b879}If there's one -good- thing about this waste of organic matter, it's her perception. She was gifted with great eyesight and hearing from the day she was born, and her curse only made her abilities even stronger, making her into a rather overpowered detective! Her observant nature allowed her to get a solid grip on her senses, granting her near-constant situational awareness. Garselle could easily tell you a lot about a person in front of her just by looking / sniffing / or especially licking them. Nowadays her main hobby is to simply observe people from a far, studying them, instead than approaching. {/col}\n\n{icon:Ability_Racial_RunningWild:25} {col:00acff}[ENDURANCE - 1]{/col}\n{col:e7b879}While her strength somehow managed to \"survive\" her self-destructive lifestyle, her stamina certainly hasn't.  Garselle's endurance is basically non-existent at this point, making her practically useless in combat situations. Even the hour-long walks around the Mage Quarter often leave the woman exhausted, making her look quite pathetic as sweat slowly flows down her furry forehead. Even the \"buff\" her curse provides doesn't help her that much unless she's in real danger and has to run for her life. Not to mention such things as sleep deprivation, drug abuse, overeating... Gah! Gross!{/col}\n\n{icon:Achievement_Halloween_Smiley_01:25} {col:ff284b}[CHARISMA - 3]{/col}\n{col:e7b879}Charming? Certainly not. She's a worgen, for Light's sake. The only admirable things about her appearance would probably be her haircut, which she values more than her own soul. She tends to be either too cynical or too shy when confronted by most people, with most conversations ending on a hefty minute of awkward silence or someone's suicide attempt(s). Occasionally (usually after a minor drug overdose) her true, arrogant self begins to shy through , giving the public a better look at Mrs. Appleby's messed-up personality. \nHowever, it'd be fair to admit that certain people have found Garselle, quote, \"cute\", possibly due her animalistic snout's chubbiness, giving her a puppy-like look, especially during her rare moments of joy. The \"Puppy imagery\" is only reinforced by her unnaturally \"feral\" movement and habits, ranging from constant sniffing and chewing on different solid objects to such morbid things as display of near-ecstatic, borderline-orgasmic pleasure if one were to scratch her furry neck.{/col}\n\n{icon:Spell_Shadow_Brainwash:25} {col:c000ff}[INTELLIGENCE - 7]{/col}\n{col:e7b879}Garselle's a nerd. Like, a HUGE one, both literally and figuratively. She spent most of her life either eating or reading books, and her lust for knowledge made her learn many skills, as well as simply trained her brain into a miniature supercomputer. However, her curse managed to weaken the worgen's mind at the same time, rendering her rather forgetful and, at times, blunt. Her knowledge is great, but there's little possibility for her to use it.{/col}\n\n{icon:Rogue_BurstofSpeed:25} {col:5950ff} [AGILITY - 1]{/col}\n{col:e7b879}What? A fat person being agile? BWAHAHAHAHA, by the Light, you're such a kidder, dear retard who wrote this profile! \nBad jokes aside - just like Garselle's endurance, her agility has suffered a great deal from her life of indulgence. The best she can do is jump on and off a table while yelling something about homosexuality incoherently.\nHer movement is clumsy at best. Most of it looks either too unnatural, or too \"weak\", as if she had trouble standing on her legs.{/col}\n\n{icon:ACHIEVEMENT_GUILDPERK_LADYLUCK_RANK2:25} [LUCK - 3]\n{col:e7b879}It's hard to say exactly how lucky she is, since her biography is mostly a tale of extremes (luck-wise). On one side - her life as she knew it has been completely and utterly shredded to pieces after she got infected with the curse, but on the other hand, she is now left with enough money to make Westfall great again, and has no -real- problems (except for herself, of course).{/col}\n\n{h3:c}{col:ff2c00}SKILLS{/col}{/h3}\n{col:e7b879}As mentioned above, she has way too much free time on her hands, so, she tries entertaining herself through learning and studies related to various subjects. Despite all odds, her studies have proven to be somewhat fruitful.{/col}\n\n{col:ffffff}Writing / Poetry - 20/100 [Dilettante]\nArt / Drawing - 30/100 [Hobbyist]]\nCooking - 50/100 [Hobbyist]\nAlchemy - 35/100 [Hobbyist]\nArcheology - 45/100 [Hobbyist]\nHistory - 55/100 [Professional]\nHugging - 100/100 [Master]\nDancing - 70/100 [Professional]\nMedicine - 45/100 [Hobbyist]\nHerbalism - 30/100 [Amateur] {col:208d00}- (note: you gotta know whatcha smoke){/col}\n{col:ffffff}Tailoring - 60/100 [Professional]\nCraftsmanship - 10/100 [Dilettante]\nJanitorship / various \"domestic\" skills - 70/100 [Professional]\nFine-dining and other useless manner-related skills - 60/100 [Professional]\nScholarship - 70/100 [Professional]\nCombat - 0/100 [Unavailable]\nMusic - 30/100 [Amateur]\nArcane arts / magic - 30/100 [Hobbyist]\nLockpicking - 35/100 [Hobbyist]{/col}\n\n\n{h3:c}{col:ff2c00}SPECIAL ABILITIES AND ATTRIBUTES{/col}{/h3}{col:e7b879}\nAs strange as it may seem at first, Garselle, too, posesses quite a few interesting abilities that benefit her in certain, overly-quirky ways.{/col}\n\n\n{col:00ff7b}[LIGHT'S EYE]{/col}   {icon:TRADE_ARCHAEOLOGY_CATSTATUEEMERALDEYES:25}\n{col:e7b879}Ability to instantly recognize and memorize a person's appearance and certain traits as long as they're within a 500m range. (passive){/col}\n\n{col:c000ff}[FIRM AND DRY]{/col} {icon:70_inscription_vantus_rune_suramar:25}\n{col:e7b879}Ability to manipulate certain objects within a 10 meter radius using the power of the arcane. The range is increased up to 100 meters if the object is infused with any form of magic or is affected by any form of runes.{/col}\n\n{col:ffcc00}[FILTHY ACTS AT A REASONABLE PRICE]{/col} {icon:INV_Ore_Gold_Nugget:25}\n{col:e7b879}Her mother's wealth and connections allowed her to slip rather easily through the \"cracks\" in the Stormwind justice system. It's not really an ability. Just the author wanting to write more stuff to make their character seem like a special snowflake with loadsamoney. (Passive){/col}\n\n{col:ab888b}[HEART ATTACK]{/col} {icon:Ability_Hunter_Pet_Wolf:25}\n{col:e7b879}More of a side effect rather than an ability. If Garselle won't consume any of the prescripted potions / medicine within 24 hours since the previous intake, she will soon find herself (literally) losing her mind as she descends into the pure animalistic states of berserk, allowing the beast within assume direct control over her actions.{/col}\n\n{col:ff953f}[FFW]{/col} {icon:Spell_Mage_AlterTime:25} & {col:5950ff}[REW]{/col}    {icon:Spell_Mage_AlterTime_Active:25}\n{col:e7b879}Technically, these are two separate abilities that have been grouped up together due to their extremely similar nature.  Made in heaven allows Mrs. Appleby to accelerate the flow of time within a single entity / person, essentually acting as a FFW button on a remote control. Meanwhile, BTD does exactly the opposite - reverses the flow of time within the selected entity. Localized nature of the abilities, as well as the lack of any actual object displacement within the timeline allow the time-trickery to flow by,unnoticed by the Bronze dragonflight. It'd be worth mentioning that both abilities are extremely underdeveloped and only serve as a sign of this character's moderate chronomancy potential. She lacks the stamina and skill to maintain the spell for a time longer than a few seconds, and the overall \"percentage\" of \"time speed\" is yet to breach the 50% \"cap\".\nTLDR - She can do chronomancy on a very basic level.{/col}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n\n\n\n{img:Interface\\ARCHEOLOGY\\ArchRare-VrykulDrinkingHorn:512:256}\n\n\n",
