					["TX"] = "{h1:c}\"GRAWFE\"\n\nReinhardt Lorvren{/h1}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{p:c}Lorvren is quite the example of a Gilnean; features chiseled, hair and facial hair well looked after. The man's body clearly suggests he is a fighter. He is well toned and muscled all over, and somehow appears wolfish even when within human form; a heavy set brow and slightly pointed canine teeth noticeable. If he wasn't quite so muscular, he couldn't possibly survive under the plate or mail he is occasionally found wearing; while the armour may change, it is never anything other than heavy gear, and he wears it proudly. Otherwise, the man will be found in a simple blue shirt, open at the front to bare his chest. \n\n\nWhile in worgen form, he stands as tall as the general afflicted Gilnean, often appearing alert. His ears are perked alike a feral wolf, standing at attention and always listening out, surrounded by an unkempt mane of fur. This generally follows through the rest of the worgen's fur; clean, but quite messy.\n\nThe Gilnean's voice is deep, whether in worgen form or not. It almost seems as though he's always had a wolfish way about him - his words spoken with a husky tone. If any who previously knew the man heard his voice, they'd note that his accent has shifted more towards that of the typical Gilnean despite having maintained his \"posh\" mannerisms beforehand. Perhaps it is due to current company.{/p}\n\n{h3:c}\n{link*https://www.argentarchives.org/node/191235*AA} - {link*https://www.youtube.com/watch?v=dC-ENYmC85k*The Song} - {link*https://tinyurl.com/2fcpre6*F-List}\n{/h3}",
