				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-ArcaneStorm:512:128}\nAppearance    \n{icon:Achievement_TheNighthold_SpellbladeAluriel:25}Her eyes are as blue as the summer sky, her hair is long and dark as the night, her skin is pale not only because she is a elf but because the time spent reading indoors rather than outside. Her body is a lithe from her training with blade.\n\n{icon:INV_Helm_Cloth_RaidMage_Q_01:25}The high elf wears on her chest a sleeveless lavender vest roughtly a foot long. At her hip is a waistcloak reaching down to her ankels in the same purple color as her vest. On her feets to her knees she wears boots in silvery leystone with a winglike decoration. Her forearms bears leystone bracers that have the same winglike patern. \nOn her side she carries a elven spellblade named the stars edge.\n\n \n\n \nBiography\n{icon:INV_Archaeology_70_PurpleHillsOfMacaree:25}Ithalwen Azureweaver is the daughter of a elven ranger and a viniter, as young Ithalwen found herself more intrested in the history of Azeroth than she did in Swordmanship, though her mother trained her in it regardless of her protests. Magic came easy to her, and she spent much time studing the ancient texts and manuscripts. She even began study the secretsof time before it was legal.\n\n{icon:INV_Sword_1H_ArtifactFelomelorn_D_06:25}After the sunwell colapsed Ithalwen took her training in swordmanship seriously as she no longer had the infinitive mana of the sunwell. And when she left Quel'thalas she set out to explore and learn from this large and wonderous world.\n\n",
