					["PH"] = {
						["IC"] = "Ability_Warrior_StrengthOfArms",
						["BK"] = 1,
						["TX"] = "Before you stands a taller woman with eyes bright in wonder, it can be no other than wonderful Becca, from others picked asunder! \nShe smirks at you with dangerous lips, like parfait so sweet and colouring thick.\nHer skin, quite pale, is soft to the touch, but would she let you? One doubts it quite much.\nShe's slim, quite frail, yet stands quite strong; her legs as tempting as they are long.\nShe beckons you over, tattoos on her arm, threatening? Not quite, she won't do you much harm.\nBut do not be deceived,\nShe's a crafty one, indeed.\nIt's clear she would rather charm her foes, with dimpled cheeks, pierced ears, and nose.\nBrushing back her wavey brown hair, Oy vey! You're enthralled, you're locked in her stare.\nBefore you seats Becca, inquisitive look,\nShe puts down her pen, \nand closes her book.",
					},
					["HI"] = {
						["IC"] = "INV_Misc_Book_17",
						["BK"] = 1,
