				["T1"] = {
					["TX"] = "{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n\n{h1:c}The divine woman with the seducing smile{/h1}\n\n{h3:c}Before you stand the holy presence of Minorah Mikas. Honey blonde, long, silky hair flow down to her midback and remains almost completely straight apart from some curls at the tips. Fair, smooth skin and a pair of soothingly skyblue eyes meet your gaze, and as alluring as she may be, she seem completely serious at all times. Her peach colored lips are often curled into a warm and honest smile, to fit with her kind looks.\n\nIf you allow your eyes to travel further down her body, mostly adorned in a high quality dress, her bodytype is lithe. She is quite obviously trained, but not enough to be called bulky or even that strong. Just strong enough to swing a sword and to get to whoever needs her while carrying her heavy choice of clothing.\n\nIf there is anything more you want to know about her, other than what catches the eye that is, do not hesitate to speak up by now. Minorah will listen.{/h3}\n\n\n\n{p:c}{col:ffffff}Be careful little hands what you touch ~ \nOh be careful little hands what you touch ~\n\n'Cus even if she looks lush\nShe will turn you into mush\n\nSo be careful little hands what you touch ~ {/col} {/p}\n\n\n",
