					["TX"] = "An old and corrupted looking example of a Demon Hunter. Upon close inspection, she seems to have more pronounced demonic features then others:\n\nHer skin has hardened in places to a slick, scale-like skin akin to demons. It's surface was eerily smooth, but hardened to resist blows. Her raven hair had retained a soft texture, ever well-maintained, it cascaded down her back and front like a waterfall, flowing as she moved.\nOn the right of her face, the front locks of her hair had a single obsidian feather woven within them, imbued with a faint nature's blessing.\n\nHer build was trained, muscular, and lean, and her training showed in her bodylanguage. Every movement seemed practiced and calculated. Rarely did she slip into a casual posture unless she made a conscious effort to do so.\n\nHer body is musclebound and broad, with only a faint hourglass curve. Though posessed of a well-developed chest, when seen, faint, Fel scales can be seen above and below, having grown over the edges of her orbs in ruination of her former beauty.\n\nWhile she seems distant, a common smile on her lips implies she may be more approachable then the horns suggest.",
