			["zone"] = "Elwynn Forest",
			["about"] = {
				["read"] = true,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "\n\n{h1:c}{col:e7927d}Pamela-Jill, priestess in training{/h1}{/col}\n\n{col:f9fff1}Pamela-Jill is a cute girl from the first look of her; with her puffy cheeks, large desaturated blue eyes and plain lips, the majority would consider her to have that of a 'babyface'. Her hair is usually kept quite neat and one can tell she is a lady who takes pride in her appearance.\n\nHer body does not resemble that of a child however; her healthily chubby stature is graced with curves which can hardly be ignored, especially not when she's wearing her usual priestly, white garments.\n\n\nPJ carries herself as the kind of woman who likes to have a good time, whether that means getting up to no good from time to time or visiting friends; she is overall a very polite girl-- though beware of getting onto her bad side, she has quite a temper.{/col}",
