		["0517200839jMXBj"] = {
			["character"] = {
				["CO"] = "I often forget to update currently.\nQuestions? Interested in the Dainty Damsel?  /w me! <3",
				["RP"] = 1,
				["CU"] = "Presentable. \n\n0/3",
				["XP"] = 2,
				["v"] = 21,
			},
			["time"] = 1498860844,
			["zone"] = "Tanaris - Waterspring Field",
			["about"] = {
				["read"] = true,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h2:c}Physical description{/h2}\n\n\nAs with many of his kinsmen, Dragour has seen and spent many a day plowing the main, and as a result, skin often carried the touch of the elements along with it. His skin was sunkissed, not enough to warrant any interest, but with enough colour to keep the pale hue typical for citydwellers at bay. A few blemishes may draw the attention of onlookers where small fading scars, as if made by several small cuts, make their mark upon his face.\n\nGolden locks of hair fall neatly atop his head, enough to warrant that a certain degree of care has been put into it’s appearance more often than not.Often kept lighter in hue due to the sun beating down upon him during long days of hardship, toil, and loitering around,the hair stretches down the sides of his jaw, covering his lower face with the same blonde fuzz, here kept short, yet as with many a sailor, thick and healthy.\n\nThe beard, healthy as it was, made little to help disguise the distinct shape of his face. The broad triangular jaw stood clearly defined, his jawline a glimpse of the impressive physique the man pushed himself rigorously to maintain. His nose, straight, as if never broken or masterfully healed, maintained a sharp presence in between two sharp eyes, their stormy blue gaze protruding below a set of defined eyebrows.\n\nAs for his body, one does not need to observe Dragour for long to realize that it’s one of his greatest assets. At times maintaining an unhealthy ideal of perfection, he pushes himself to reach it, at other times having to reallocate the time and focus on other matters. Broad shouldered, with his chin held high and the posture that comes with serving fifteen years amongst Kul Tiras’ finest, the man carried himself with an undeniable presence, his gaze never shying from confrontation.\n\nBelow whatever apparel he carried for decency and protection, a thousand stories are told upon his flesh. Not as weather beaten as his face or hands, his skin keeps a paler tone, yet not enough so to hide the bleak scars that litter his body. While most are miniscule by healing or craft, the man’s profession is all too apparent. Circular wounds from bullets, cuts and stabs, they all make their mark across his flesh. However, one set if of particular note.\n\nUpon his back a tale is told, one which he himself prefers to not put to words. Stretching one way and the other, diagonally across his back, are the marks of a brutal flogging. The years have done theirs to hide the brutality, but if running a finger across his bare back, almost each and every cut could be felt as they intersect below the broad shoulder blades. Small, slightly red to the hue, circular marks litter this brutal canvas, a lasting goodbye from a red hot poker.\n\nTwo more marks make their home upon his flesh - but these had been conceived under less horrific of circumstances. Dragour has during the years acquired two tattoos, one on his lower left arm, and one on his upper right arm, just below the shoulder. The first one, on his inside of his left forearm, is of a sprawling flower. With supple green vines and leaves, blooming colours of golden yellow, red and white stretch down the inside of the hardened marine’s arm, stretching from just by the nook of his elbow down to his wrist. The second tattoo is simpler, a black anchor inked on on his right arm, the four letters “K T M C” spaced out underneath, slightly curved as to follow the anchor.",
				},
