						["TX"] = "Kal is a short elf with a toned body and bright white hair. He has scars covering his face and upper body. The scars on his upper body are less noticeable than any others however. Kal can usually be seen in armour most of the time. If not in something that protects himself, He likely has other tricks to protect himself from harm.",
