			["character"] = {
				["CO"] = "Shoulder thunders and disc behind the head are ooc.\nLove random rp feel free!\nYes hyacinth is a real flower both irl and wow!\nLooking At=Target come on head turning!\n",
				["RP"] = 1,
				["CU"] = "Seems rested.\nIllusioned.\nCarrying a leather satchel.",
				["XP"] = 2,
				["v"] = 40,
			},
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-mage-cover:256:256}\n{col:f8fcff}Character Theme:{link*https://www.youtube.com/watch?v=OglkeWkzmlk&list=PL712ECFB7E547CC9D&index=2*Main theme - Neverwinter Nights}\n{link*https://www.argentarchives.org/node/172362*Argent Archives Page}{/col}\n\n{h3}{col:a628ff}Face{/col}{/h3}\n\n{col:f8fcff}Her long hair, falls all the way down to her upper legs. Somewhere in between her waist and kneecaps. Under moon light, it would seem they glitter with a cyan bluecolor. One could say, they're being well taken care off.\nThey start to curl more and more as they go more and more toward the end, giving it a nice yet natural look.\nLike most of her kin she bares angular facials with well shaped cheekbones and a small nose slightly curved upwards.\nA pair of silverish blue eyes can be seen, watching around as much as they can, bearing a kind yet thoughtful look and around her eye sockets her marks can be seen a pair of green leaves, as green as her firm lips and between her lips when she smiles a pair of fangs can be seen not too long yet still they do not look like any ordinal humanoid teeth.{/col}\n\n{h3}{col:a628ff}Body{/col}{/h3}\n\n{col:f8fcff}Lady has an athletic body, although she does not seem to be a young adult she also does not seem to be too old, she does not have any wrinkles yet she can be compared to a human whom is at her late twenties or early thrities. Although seems athletic she is also not fully thin, she has an hourglass shaped body with a wide bosom and hips, more motherly than a young adult.\nUnder her armor her body is adorned by runes starting from her feet and going till her neck, even her hands are covered by them. It looks more like different runic patterns than one big one, they are dim if not being used, when used they usually glow with a bright bluish color.{/col}\n\n{h3:c}{col:a628ff}At First Glance{/col}{/h3}\n{col:f8fcff}((For none trp users!^^){/col}\n\n{h3}{col:a628ff}Aura{/col}{/h3}\n{col:f8fcff}Elven lady emits a rather strong and a potent arcane aura for the ones with keen senses and ability to sense much, aura as strong and potent as it may feel also feels rather under control, swirling around the elf's being in a calm manner.\nOnes who try to perform scrying over the lady or ones with specteral sight may see or sense depending on the action they have taken wards and spell works around the aura.\nFor what purpose, who knows..?\n((Feel free to whisper oocly for any questions)){/col}\n\n{h3}{col:a628ff}Attire{/col}{/h3}\n{col:f8fcff}Elven lady wears a rather \"heavy\" robe set, similar that of a battle mage, not only made from silk yet also some sort of a metal component.\nUpon closer look it can be seen that there are also carvings over the armor's metal parts, it's base inner layer is made from silk, having metal parts over areas like chest, side legs and of course shoulderpads, giving a lot more protection yet of course also hindering elf's mobility.\nWhile it looks rather simple in design skilled smiths or ones with enough knowledge about metals can see that metal parts are made from cobalt and truesilver.{/col}\n\n{h3}{col:a628ff}Voice&Posture{/col}{/h3}\n{col:a628ff}-Voice-{/col}\n\n{col:f8fcff}Elven Lady has a rather gentle and soft tone, mellow even although with a hint of age in it, sounding neither too old nor too young with a clear confidence behind it.\nIt rarely raises to be a shout or a yell.{/col}\n\n{col:a628ff}-Posture-{/col}\n\n{col:f8fcff}Elven Lady emits a noble aura as she walks with fluent moves with her spine and chin up right always, standing out in the crowd.{/col}\n\n{h3}{col:a628ff}Valuable Belongings!{/col}{/h3}\n{col:a628ff}-Rings-{/col}\n\n{col:f8fcff}She wears two rings, one on her right hand's ring finger seems to be made from silver yet having a rather odd look to itself, one who knows about elven craftsmanship may realize that it is elven made.(Quel'dorei){/col}\n\n{col:f8fcff}Over the ring a small blue gem can be seen and if one gets close enough they can see a writing that says; \"My light\".\nOther one on her left also seems to be made from the same metal and has an elegant looks to although it looks quite different than the other ring.\nIt also carries a blue gem pulsing with a faint arcane aura and over it a flower carving can be seen if one knows enough about herbs person may realize that it is a hyacinth.{/col}\n\n{col:a628ff}-Scarf-{/col}\n\n{col:f8fcff}Sel always wears a well made blue scarf!..Why..No clue yet it has a nice light blue tone!\n((I hide the glance when she does not wear it!)){/col}\n\n{col:a628ff}-Necklace-{/col}\n\n{col:f8fcff}Lastly elven lady always carries her necklace, for ones who know about metals it should be as clear as day that it is made by the same material of the ring(One with hyacinth) and like the ring it emits a really weak and faint arcane aura.\nIt like the ring carries a blue gem and over it carving of a book and two staffs can be seen, staffs placed in a shape of a cross over the book yet necklace is only visible when she is not wearing her armor.{/col}\n\n{col:a628ff}-Bracelet-{/col}\n\n{col:f8fcff}Elven lady seems to be wearing her bracelet all the time like her other belongings, clearly it is quite important to her.\nFor ones who are familiar with such matter it is made from moonsteel, having a build made from thin chains, sparkling faintly under light.\nIt also has a locket and inside it picture of the elven lady and a human with orange hair and a pony tail can be seen.{/col}\n\n{col:a628ff}-Satchel-{/col}\n\n{col:f8fcff}Elven lady nearly all the time walks around with her satchel over her right shoulder, according to rumors she sometimes even sleeps with the satchel on!\nAlthough she carries it with such value it seems to be your regular leather satchel, made from leather, rather large and looking stuffed, one may only wonder what may be inside of it?{/col}\n",
				},
