					["PS"] = {
						["TX"] = "Shy, lonely, sarcastic, heavy drinker & curious - That's Malthuin for you; A long-time wanderer, often called a loner, freak & Hordelover for his ability to enjoy any member of the Horde's company, although he often sits alone in any inn or walking around, usually accompanied by his cat, Calico Jak.\n\nMalthuin's way of life has never been violent, as he often tries to avoid violence & tries to solve things in a quiet manner - Something that many Warriors have disliked him for. He is also not a man of faith and does not believe in the Light, while also having having a pretty low self-esteem.",
						["BK"] = 11,
					},
					["HI"] = {
						["TX"] = "Born in a poor family in Stormwind, Malthuin quickly got into some trouble out of desperation for money - At age 7, his parents died by the hands of the Stormwind Guard for stealing some food, which greatly angered Malthuin & was taken in by a gang of thieves, growing up as a small-time burglar & though not violent, he had a great  hatred for the way of the Alliance, as well as also often doubting in the Light.\n\nWhen he was 19-years old he left the guild of thieves to find himself in the world of Azeroth, travelling to many locations, before finally coming back to a changed Stormwind when he was 30, but his years wandering alone in Azeroth has taken its toll on him, as he isn't very social and often tries to hide from the world.\n\nNow he either wants to silence his hate for the army by joining the ranks of them - or go back to his roots as a criminal.\n",
