			["about"] = {
				["v"] = 70,
				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-paladin-cover:256:256}\n{h2:c}Overview{/h2}\nFrom a long distance Alex may look old due to his white hair, but on closer expection it is clear that he is as very young man, still in his teens even. His posture is very straight and uprite. The way he stands it is clear that he is trained in a very discaplined manner, he will often stand, unmoving until his superiors order him otherwise. Alex tends to use the terms \"Sir,ma'am,my lord/lady\" often in his vocabulary when greeting people. Alex previously tended to salute when he would greet others, mostly in completely inappropriate or uneccicary situations. He has moved on from this however, seeming to be slightly better versed on when to salute and when not to. Somewhat atleast. The saluting has instead been replaced by elaberate bows. His voice is quite deep, however the primary thing noticed would be his very evident stutter, which is infact starting to fade. Alex has taken to practise dying his hair brown in the attempt to avoid awkward encounters and to lessen how self concious he feels. So sometimes he may be seen with brown hair.\n\n\n{h2:c}First Glances{/h2}\n-Physical Anomalies\nAlex has various strange physical traits that can be easily noted upon seeing him for the first time. First thing that woul be noticed would be his pure white hair. Secondly people would notice his bizzare pink/purple eye colour. Mages or learned people may know that anomalies like this is caused by exposure to a massive amount of Arcane radiation.  His hair however, may be dyed brown. If this is the case only his bright purple eyes would be recognisable of being an affect of Arcane radiation.\n-Apperal\nAlex shuffles around in his armour a lot, clearly not comfortable wearing it. He tends to wear it often, even when he's in the city to condition himself to deal with the discomfort and heaviness. When, he isn't wearing his armour, however, he tends to be wearing plain, casual clothing.\n-Weapons\nAlex classically wears a steel longsword, sheathed at his side and a large, heavy shield on his back with the insignia of Stormwind on it.\n-Shy Nature\nAlex is a very shy and socially awkward person. He doesn't tend to talk much, but when he does, he sounds nervous and stutters a lot he also talks quietly and avoids eye contact quite often.\n-Holy Aura\nParticular adept people would notice a strong connection to the light around Alex.\n\n{h2:c}Family{/h2}\nTheora Wayken (Biological Mother)\nIstaven Blademane (Biological Father)\nReilly/Ashley Wayken (Twin Sister)\n\"Garrosh\" Wayken (Unborn son/daughter, deceased)\nEmillia Applebough (Adopted Sister)\nAlexander Applebough (Adopted Father)\nBelle Applebough (Adopted Mother)\nJames Applebough (Adopted Brother)\nCharles Applebough (Adopted Brother)\nDarion Applebough (Adopted Brother)\nSylvanisa Cloud (Niece)\nMelanie Meltherne (Fiance)\n\"Zul\" Applebough (Unborn son/daughter)\nFlinky Blitzcrank (Somwhere between pet and the gay Uncle)\n\n{h2:c}Inventory{/h2}\nCurrency=5G, 22S\nArmour\nSword\nShield\nStormwind surcoat\nNightingale Society surcoat\nHoly tome\n1 minor healing potion\n{img:Interface\\QuestionFrame\\answer-horde:512:256}",
