						["TX"] = "Cados is a tall muscular death knight, Usually covered head to toe in amour and with a runeblade on him. When not in armour he has scars and burn marks over his chest and lower body.  He rarely takes his armour off as a result of the scars.",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "Cados is a flirty elf with good intentions most of the times. His firting has him in trouble sometimes however. Cados is normally a pretty chill guy and doesn't get angry quick. But when he does he is incredibly violent.",
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "Once a proud thief, Cados went around stealing things to survive. However, one day while on a mission. He fell off a cliff. Breaking his bones and wounding him. Cados didnt want to die because of such a measely wound however. So he attracted the attention of a couple of orcs nearby. Unfortunately for Cados, They were drake riders and as such, Cados was burnt and slashed to death. After being raised as a undead. Cados was a excellent killing machine for the Scourge. Then Arthas' grip on the death knight weakned. Which gave him free will, With his free will, Cados decided to stray away from the ebon blade, And now makes money by fighting on the isles or by doing mercenary jobs.",
