					["TX"] = "{img:Interface\\ARCHEOLOGY\\ArchRare-DruidandPriestStatue:512:256}{h1:c}{col:ca1013}Allarias Crimsonleaf the Wandering Blade{/col}{/h1}\n\n\n{h3}{col:ca1013}Allarias was born a long tie ago in the coastal village of Auberdine.His mother a proud huntress and sentinel and his father a druid of the claw,both him and his sister Syrieth were destined for a bright future.While Syrieth pursued the path to become a sentinel Allarias did not want to pursue his in becoming a druid as he put it''I want to be on the frontlines like mother and protect our people not dream for ages and fail to see my family like my papa''.So as a male he could not join the sentinel but he chose to aid them in another way,by beein a blacksmith.As years passed he honed his craft in smithing while,learning to use a blade from his mother..soon enough his lust for adventure and travelling overcame him and his adventure began..''{/col}{/h3}\n\n\n{h2:c}{col:ca1013}\"More in the upcomming Argent Archives,until then find out ic or ask in /w\"{/col}{/h2}",
