		["0505130058q^tR)"] = {
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Plate Gear",
						["IC"] = "INV_Misc_Desecrated_PlateChest",
						["TX"] = "Thorbert's plate attire varies when it comes down to choice of weaponry. However, it stands out with its form and its effect on his physique. Aside from the display of implecable craftsmanship, the armor covers every inch of his body, except for his neck.\nAside from his jugular being exposed, the weight of the attire lives up to its reputation by rendering his speed.\n\nAll in all, one could describe Thorbert as a juggernaut if said person would notice him wearing all the pieces that consist it.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Clothing",
						["TX"] = "Thorbert seems to be a man whose taste in clothes are bland, unimaginative. Rather, one could conclude clothes are just for their primal purpose: coverage and warmth.\n\nHowever, one might notice him pacing on the cobbled or dirt roads wearing rather fancy, expensive garments. In this case, Thorbert should be admired profoundly as it is truly a rare moment; one even he cannot comprehend and simply give in to astonishment of his own persona.",
						["IC"] = "INV_Misc_ClothScrap_01",
					},
					["2"] = {
						["IC"] = "INV_Leatherworking_70_petbed",
						["TI"] = "Leather Gear",
						["AC"] = true,
						["TX"] = "The material used in crafting Thorbert's leather attire is procured from the sturdy animals of Northrend. Warm and tough, these garments offer enough protection for the vital parts and a style to be rivaled. Furthermore, his speed is hardly affected by this armor when worn, a reason that qualifies as an excuse to chose certain means of physical destruction and harm.\n\nAll in all, one would say this can be an ideal attire for Thorbert to wear, but then there's the matter of subjectiveness that must be taken into consideration.",
					},
				},
				["ST"] = {
