				["v"] = 81,
			},
			["link"] = {
				["Árren-ArgentDawn"] = 1,
			},
			["characteristics"] = {
				["LN"] = "Bartol",
				["EC"] = "This Color",
				["PS"] = {
					{
						["ID"] = 1,
						["VA"] = 4,
					}, -- [1]
					{
						["ID"] = 8,
						["VA"] = 5,
					}, -- [2]
				},
				["AG"] = "31",
				["IC"] = "Ability_Racial_BetterLivingThroughChemistry",
				["EH"] = "d38258",
				["HE"] = "181 || 5ft 11'25\"",
				["CH"] = "7b83a9",
				["RA"] = "Human",
				["RE"] = "Local Inns",
				["v"] = 33,
				["CL"] = "Con-Man",
				["MI"] = {
					{
						["IC"] = "Ability_Hunter_BeastCall",
						["NA"] = "Nickname",
						["VA"] = "Bert",
					}, -- [1]
					{
						["IC"] = "INV_Inscription_ScrollOfWisdom_01",
						["NA"] = "Guideline",
						["VA"] = "Any methods are allowed, as long as they're based on respect.",
					}, -- [2]
				},
				["FN"] = "Thorbert",
				["FT"] = "Professional Bipolar Entrepreneur || Engineer",
				["BP"] = "Brill",
				["WE"] = "Well Built",
			},
			["character"] = {
				["CO"] = "Profile Rework\nI'm not creative, I'm inventive.",
				["RP"] = 1,
				["CU"] = "Visibly agitated.",
				["XP"] = 2,
				["v"] = 41,
			},
			["about"] = {
				["v"] = 90,
				["BK"] = 6,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{p:c}{img:Interface\\PETBATTLES\\Weather-StaticField:512:128}{/p}\n\n{p:c}>>still a draft<<{/p}\n\n{p:r}{link*https://www.youtube.com/watch?v=GoCOg8ZzUfg*THEME}{/p}\n\n{h3}{icon:Ability_Mage_MassInvisibility:25}{col:8c9790}Personality{/col}{/h3}\n\nThose interacting with Thorbert would notice an out-going, pleasant aura about him. However, certain moments would offer brief tints of mystery to his persona. Some would say that he has two personalities, albeit, not even he can say for sure the nature of his mental state. Therefore, it shall remain a mystery.\n\nAside from a complicated behaviour, Thorbert offers signs of empathy abilities and a discipline of iron. One would think he was once either part of an organised group or one of the ants of the army. Nevertheless, one doesn't need to approach him as he will do it first. He emphasises on social interactions above all else, enjoying making friends or lady-friends.\n\nHis view upon these social relationships turns out to be one of a kind, though; if one wouldn't take into consideration the goblin stereotypes. A friend is a friend to him, just as the common folk considers others he or she gets along with. The spice Thorbert adds to this social equation resumes to the principle of respect; no one reaches the friendship degree until they earned his respect. This offers the legitimacy of the time spent in the company of the goblins and his pure spirit of entrepreneurship. In addition, one could say he easily defines the diference between personal relationships and business relationships, outlining a possible cold logic.\n\n{h3}{icon:LEVELUPICON-LFD:25}{col:ffad7e}Physiognomy{/col}{/h3}\n\nThorbert calls for a towering posture, defined by his height and sketching the idea of a prolonged exposure to platewear and combat.Time spent with a tool of harm in his palm confronting an opponent is also implied by the presence of skin disfigurements.\n\nEtched deep within his skin is probably the most visible scar his body supplements, located on his left extensors muscle. The size of it implies a rather deep wound, probably an attempt at chopping off his hand; a story only he could tell! Aside from this skin deformation, several scars can be acnowledged around his belly, right shoulder, accompanied by two others on the left side of his neck. Most of the cicatrix pale in comparison to the one on his arm, only telling a story of combat if anything.Those engraved on his neck compel a perplexing aura to the story behind them. Such is possible due to their odd nature; thin, long and perfectly drawn along the surface of his skin.\n",
				},
			},
		},
