				["T1"] = {
					["TX"] = "{p:c}Appearance{/p}\n\n{col:87dfff}Calaran is a burly man - standing at around 182cm and weighing around 94kg. His back and shoulders are wide and the body overall shows signs of manual labour. His face appears slightly feminine, especially his full lips. His right eye is missing and has been replaced with an eye of stone, ever appearing to be gazing ahead. The left one is emerald green and almost always in a relaxed state. His long light brown hair usually flows freely unless he braids it.\n\nHis choice of clothing may make the fashionistas cringe, for they are quite horrible to the eyes. Usually colorful, mismatched and awry, many a person might stop and comment negatively or sarcastically, but he pays no mind to naysayers.\n\nCalaran walks the grounds with confidence and determination, never slouching and always standing with a straight back.{/col}\n\n{p:c}{link*http://tinyurl.com/Calaran2*Portrait}{/p}\n\n{p:c}At first glance{/p}\n{col:86ffbf}A simple earring on his left ear.\n\nA small pinkish fang hangs on a leather string around his neck.\n\nHis right eye has been replaced with a leystone.\n\nA small scar across the bridge of his nose.\n \nA tattoo under his right forearm. It represents a snake getting impaled by a stake.\n \nOften wears very colorful clothes.{/col}",
