				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Necklace",
						["TX"] = "An odd shaped necklace dangles around from her neck, formed in the shape of a cat, changing colours to fit her mood:\n\nBaby blue: Dandy.\nNavy blue: Upset.\nWhite: Average.\nOrange: Annoyed.\nGreen: Frustrated.\nPurple: Odd.\nBlack: Confused.",
						["IC"] = "INV_Belt_31",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "A satchel?",
						["TX"] = "Yes.",
						["IC"] = "ACHIEVEMENT_GUILDPERK_BOUNTIFULBAGS",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Witty",
						["TX"] = "Lira is a woman of wit, a woman of sarcasm. Some love it, others can't cope with it. This doesn't go too well for someone who aspires to be a great Mage. Good luck.",
						["IC"] = "INV_Legion_Faction_KirinTor",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Extras",
						["TX"] = "Visual ref: Taylor Hill.\nVoice ref: Sabrina Benaim.\nInjuries -  Under her hood, there seems to be a few bruises on her face.\nTattoos - Ivy type tattoos flow around the woman's wrists, in a forest green. In each leaf adorns a name in cursive ink.\nNecklace - Dawning around Lira's neck is a sapphire charm, in shape of a flower head.",
						["IC"] = "INV_Chest_Cloth_11",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Scent",
						["TX"] = "Lira has a floral scent lingering around her person, with a slight lemon and lime zist. Though, it often changes. \nCurrently: Lemon and lime.",
						["IC"] = "INV_Misc_Herb_Kingsblood_Petal",
					},
				},
				["v"] = 56,
			},
			["time"] = 1499363660,
			["zone"] = "Stormwind City - Mage Quarter",
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-mage-cover:256:256}\n\n{h2:c}{link*http://imgur.com/a/M4a1D*Vahlira References!}{/h2}\n{h1:c}{col:5cffd1}Vahlira Edelweiss Beaulieu{/col}{/h1}\n\n{p:c}{col:47adc1}The lively, and youthful woman who stands before you owns cheery features. Her icy blue orbs offer warmth, and comfort. Yet, her eyebrows suggest she's more serious than she tends to be. Her form is dainty and petite, yet some may notice her curves. Adorning her back and stomach lie light scarring. The rest of her body is clear, with little to no markings. To Lira's scalp is a mane of almost honey blonde hair, flowing past her ribs, and of course, well kept. Many have described Vahlira's eyes similar to cat eyes; calm, yet alert. Her skin is tanned, but still very light compared to many others, it's nothing unique. Her lips plump, but not overly so. As a whole, this woman is basically the face of youth, but not child-like. Even someone of her stature, she's known to act taller, her chin held high with pure confidence. \n\nThis is a woman of intellect, a woman who holds a smart-arse like tone. Her personality is chirpy, energetic and quirky. Both her visage, and her attitude has a slight bounce to it. She walks with a saunter, but always with a skip. Lira presents herself as she'd like others to try to be; seeking to be respectable, uplifting and supportive. Knowing full well this is a terrible plan, she takes it onto only her shoulders. Her shoulders.. It's clear that she was raised to walk naturally with her shoulders in line with her hips without struggle.\n\nEven someone like Lira has tattoos, but with a lot more meaning than usual.{/col}{/p}\n{p:r}{col:1f8969}Visual ref: Taylor Hill.{/col}{/p}\n",
				},
