					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Sunlight:512:128}\n\nSun-kissed and road-worn, the peculiar traveler has an unwelcoming air about him. A loner by the looks of his general body language, he is surprisingly more chipper than one would expect.\n\nMostly wearing a hat to shade his features from the treacherous sunrays, he doesn't part with it no matter what. Odd.",
