			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "Before you stands a man of regular body. Doesn't seem special in any way. Grey traces already appeared between his brown hair. One place on it, however, has it's hair torn. His face gives a feeling of boredom and tiredness. A scar runs through his right eye.\n\nAs he reveals his true form, his appearance drastically changes. Whole body is covered in black fur, again with grey traces representing his age and one spot torn. Nails turn into claws. Scar coming through his eye becomes much more visible. The Worgen looks much more muscular than his human counterpart.",
						["BK"] = 5,
						["IC"] = "achievement_worganhead",
					},
					["PS"] = {
						["TX"] = "Wartrond represents certain values he follows. Honor dictated the path in his life, sometimes leading to better events, and sometimes to worse.\n\nLord Longhowl bears skills of leadership, developed through battles long past, and through his duty in millitary. When he doesn't execute the role of a leader,  however, he shows loyalty to however he serves.\n\nHis way of looking at people often distates them to himself.",
						["BK"] = 5,
						["IC"] = "Spell_Hunter_LoneWolf",
					},
					["HI"] = {
						["IC"] = "Achievement_Win_Gilneas",
						["BK"] = 5,
						["TX"] = "                         W.I.P\n\nWartrond spent his childhood in Gilneas, where he put his effort into training swordsmanship under careful eye of his father, Lord Casimir Longhowl. At this point, he dreamt of being a respected Gilnean soldier. \n\nWhen Northgate Rebellion started, Wartrond gladly took up soldier's uniform. Sided with the Royals, he fought Rebels both with sword and the rifle. During the Battle of Gilneas, Lord Casimir was shot in the chest on Wartrond's eyes. He quickly took up a rapier, watching his father fall on the ground and charged into the attacker. The duel with the Rebel collapsing with his throat slit. This win costed him a scar running through his right eye.\n\nAs soon as fire of the Rebellion has been thwarted, rebuilding of damaged Gilneas has begun. During this time, young Lord married a woman known as Madeline Whitewall. They lived together in the Longhowl's manor. Soon a child was born.\nA boy named Dawlen. \n\nPeace couldn't be handled for long, however. Vile, curse-spreading Worgen attacked Gilneas. Wartrond was called back into his regiment to defend the city. Pushed back, soldiers have eventually been surrounded. \n\n\n\n",
					},
