		["042804452500qIQ"] = {
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Like a spring!",
						["IC"] = "Spell_Fire_BurningSpeed",
						["TX"] = "Dalton seems to move with grace and a bit of jump in every step.\nLight on his feets and ready to take off at any moment.",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Equipment.",
						["IC"] = "ABILITY_Rogue_PlunderArmor",
						["TX"] = "Dalton carries a special crafted belt that offres not only several pouches, but a whole lot of attachments. It would carry>\n\n5x small throwing knifes.\n3x pouches of ammo.\n4x Smoke Bombs\n1x Grappling Hook.\n2x standard issued army knives (sheated behind his back and coated with a anti-repairing venom.)\n2x holstered Flintlocks by the beltbuckle.\n6x Shurikens by the waistline.\n\nThe belt itself seems to be supported by braces that runs underneath his armor. Allowing the weight to be supported.\n\nAlong side this, Dalton may often carry a large rucksack, and his standard issued army rifle.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Observant",
						["IC"] = "Sha_Ability_Rogue_BloodyEye",
						["TX"] = "Dalton is a very observant person. Noticing the smallest of things, and can often see through the pictured image.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Arcane & Shadow",
						["IC"] = "Ability_Socererking_arcanewrath",
						["TX"] = "Dalton would never come by as a magic caster of any sort. A faint yet peculiar aura seems to emit small radiations only to those who are truly gifted. It seems that he's not been using arcane for a very long time.\n\n\nHowever what seems to shroud that small arcane aura is the shadows themself. One being either familiar or having a general knowledge can tell that this man uses the shadows from time to time, it's negative and chaotic effects seems to have settled with a constant looming pressence.",
					},
				},
				["ST"] = {
					["1"] = 2,
					["3"] = 3,
					["2"] = 3,
					["5"] = 4,
					["4"] = 3,
					["6"] = 1,
				},
				["v"] = 22,
			},
			["link"] = {
				["Zénìx-ArgentDawn"] = 1,
			},
			["about"] = {
				["BK"] = 1,
				["T3"] = {
					["PH"] = {
						["TX"] = "Dalton hints bypassers as someone being in complete control over his limbs in a way rigidly discpilined soliders would be.\nBroad shoulders with a thick waist, this young man moves silently on the cobbles.\n\nUpon his left shoulder and torse, your eyes could come to view a very distinct and dreadful looking scar, just as if his arm was chopped off. Looking down to his right bicep one could soon find a defined tattoo of a odd looking inscription mark.\n\nHis eyes are deep blue, almost enchanting and alluring. Surrounded with short eyelashes, piercing yet soft gaze. A stylish goatie and long silken smooth hair. Allthough rarely smiling unless approached. His first apperance could strike one as brooding and unapproachable at the first glance.\n\nPointy nose and small lips, charming and dark toned voice, perhaps a bit posh at times. Dalton walks with nothing else but grace and serenity seems to follow every step with a clear ammount of confidence.",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "Dalton could be a odd man at times, years of experience within certain areas has given him a personality unlike others. A kind and warm personality would be something -very- rare from Dalton, he can act as being a understanding being and express a fake emotion rather than his real one's. He's cold and rejective to most emotions or approaches, being very favoured with his personal space and several layers surrounding him in order to keep people far far away from him.\n\nGenerally Dalton never took any likes to noble or posh people that looks down on others.\nOne things which will have Dalton frown are people who are extremely confident, childish or acting brave.\nTrying to impress Dalton will more than likely end up in a failure.\n\nThere is no denial in his loyalty and honor. Most likely he puts this above all else, potensionally risking his own life and limbs for the cause itself.",
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "Dalton was born just outside Lakeshire. As a youngling his natural talen for arcane was undeniable, eager to learn and study at whatever given time. However this was -highly- frowned upon by his fater, doing his best to convice or beat into his head that one may never give up on the light. Regardless of his fathers action Dalton never seemed to abound the arcane, it was not untill a very deciding event were to take place, only then would he ever deny and give in in order to persue the light. Nevertheless Dalton was more or less terrible at what he did, he would much rather run around the cobbles, jumping over ever ledge and obsticle he could find, with a tome not to far away from him.\n\nExcept from the arcane curiousity Dalton was still very much raised into a military drilled life. Exceeding in the drills with stunning and brilliant edurance, Dalton was never much for heavy weight armor, as he feelt most comfortable in more light armor with swift and agile movements. \nDalton seemingly served the army for a few years before he set of to do a new line of work. What did he do during that time? Find out yourself.",
						["BK"] = 1,
					},
				},
				["TE"] = 3,
				["v"] = 5,
			},
			["character"] = {
				["CO"] = "TRP wiped~ Working on it!\nRecruiting for Shadow of Dawn.\n",
				["RP"] = 1,
				["v"] = 70,
				["XP"] = 2,
				["CU"] = "Sly smirk on his face.\n\n5/5 HP",
			},
