						["TX"] = "Youli is a large, Bulky Worgen. Looks to be in his adult years and from the wrnkles around his face a thinker at that. \nHe allways carries around his Glasses. He has a Solid White right eye with a large scar running across his eye socket.\n\nUsed to be a doctor of Medicine.",
