			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "\n\n{col:ff6844}At first glance this woman appears most friendly, her full lips curled into a knowing grin as she watches those around her. Lined with kohl are a pair of amber eyes so bright they could be described as scorching and most unsettling should you meet their gaze.\n\nEbony dreads spill from her head and trail like Serpent tails along her shoulders and down her back, numerous beeds and charms braided into her hair. Some looking suspiciously like claws and teeth.\n\nAny and all colours appear bright and striking in contrast with her dark bronze complexion, golden bangles, piercings and a serpent arm band (encircling her right bicep) are but minor details yet very complimentary.\n\nOverall she appears well maintained in her physique, toned and relatively muscled with a modest chest size. If one had to guess her age they'd find it hard to do so, anywhere from her late twenties to early forties being a possibility.\n\nHer nom de guarre \"Serpent Woman\" comes from her adoration of the species. One often draped about her shoulders like a scarf. It's tongue flicking out and tasting the air, beedy black eyes watching those around it intently.{/col}\n\n{img:Interface\\ARCHEOLOGY\\ArchRare-TrollVoodooDoll:512:256}",
