					["1"] = {
						["IC"] = "INV_chest_Leather_RaidDruidMythic_P_01",
						["TI"] = "Garb",
						["TX"] = "A blend of tight-fitted leather, hides and loose fur make up Cirthalon's attire. \nGear made with agile movement in mind.\n\nHis wooden staff radiates with natural energy. But for his own improvements upon the staff such as feathers hanging from strings or carvings worked into the shaft, it's a rather plain staff.\n\nAt his belt he keeps a long-bladed dagger. The end of the handle is shaped like a crescent moon.\n",
