					["3"] = {
						["AC"] = true,
						["TI"] = "Druidic Effects",
						["TX"] = "Over his shoulder hangs a leather satchel bedecked with the sigil of the Cenarion Circle.\n\nAttatched to the bag is also a waterskin of the same design.",
