			},
			["about"] = {
				["v"] = 71,
				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Moonlight:512:128}{p:c}WIP{/p}\n\n{h2:c}{icon:INV_LegionCircle_Faction_DreamWeavers:25}{col:1a9c50} - CIRTHALON  - {icon:INV_LegionCircle_Faction_DreamWeavers:25}\n  {/col}{/h2}{p:c}{col:1a9c50}Druid of the Cenarion Circle || Guardian of the Wilds || Protector of the Kaldorei {/col}{/p}\n{img:Interface\\Pictures\\artifactbook-druid-cover:156:156}\n{h3:c}{col:1a9c50}{icon:Achievement_Character_Nightelf_Male:25} - Physical Description - {icon:Achievement_Character_Nightelf_Male:25}{/col}{/h3}\n\n{/col}{p:c}{col:b9deff} Cirthalon stands tall, broad shouldered and toned. A body shaped by exploring the vast, dense forests of Kalimdor.\nLike all children of the stars his eyes emits a silver glow and if allowed a close enough gaze one would see the effects of his Druidic practice. Amber tendrils shimmer within.\n\nHis features are unmarred by the passage of time or war and though the weariness of the world has shaken the earth, his youthful spirit remains unyielding. \n\nHe keeps his hair sheared on the sides and in a free-flowing tail held by an emerald-gemed silver jewel resembling spiraling branches. If kept lose, he usually decorates his hair with silver-lined leaves. A bright line of wispy straws run the length of his jawline into a small but kept goatee.\n\n {/col}{/p}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n\n{h3:c}{col:1a9c50}{icon:TalentSpec_Druid_Balance:25} - Devotion - {icon:TalentSpec_Druid_Balance:25}{/col}{/h3}\n\n{/col}{p:c}{col:b9deff} Let fly your voice to Elune. The Night Warrior, deliverer of justice, protector of the earth. Pray to Elune that she would smite our enemies, Her wrath fall upon the wretched that their blood may seep into the earth.\n\nHeed the voice of Elune, shield of the blessed realm. May Her light heal our wounded and Her song keep us from harm. May at last we find peace beside the Moon Goddess, devoted children of the stars.{/col}{/p}\n\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n\n{h3:c}{col:1a9c50}{icon:Achievement_Zone_Ashenvale_01:25} - History - {icon:Achievement_Zone_Ashenvale_01:25}\n{/col}{/h3}\n\n{/col}{p:c}{col:b9deff} Text Here. {/col}{/p}\n\n\n{col:b9deff}\n\n{col:9ddaff}{/col}\n\n{col:1a9c50} {/col}\n",
