				["IC"] = "INV_Pet_Raccoon",
				["EC"] = "Green",
				["FT"] = "Warrior-In-Training",
				["FN"] = "Dean",
				["WE"] = "Lanky",
			},
			["character"] = {
				["CO"] = "Hi! Yes, hello!\n\nFeel free to toss me a whisper, I love casual banter.",
				["RP"] = 1,
				["CU"] = "An overall mess - hair tangled, pale, seemingly a broken puzzle-piece.\n\n• Prayer book tied to his belt.",
				["XP"] = 2,
				["v"] = 58,
			},
			["about"] = {
				["v"] = 9,
				["BK"] = 18,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{col:ffc7a3}Argent Archives Page: {link*https://www.argentarchives.org/node/153571*https://www.argentarchives.org/node/153571}{/col}\n{img:Interface\\QuestionFrame\\answer-InnAlliance:512:256}\n{h2:c}{col:161616}Dean Cullen{/col}{/h2}\n{h3:c}{col:161616}Human Appearance{/col}{/h3}\n{col:ffffff}Though tall, Dean stands out as a youngling due to his lanky physique and child-like expression. Large green eyes gazing about at everything curiously, his face freckled, and a buck-toothed smile.\n\nHis hair is a bright brown tone, recently cut short in something similar to a bob - his fringe still long enough to reach behind his ears and occasionally kept in place there with a simple hair-pin.\n\nUsually seen wearing an oversized Gilnean tabard, along with either casual outfits, his lighter training gear or his new plated armour, very rarely wearing anything that speaks of fortune or coin.\n\nAt times he carries his wooden practice sword with him, although as of recent he can also be seen carrying a shield, and a sheated blade. He also has a book by his belt, titled \"Hymns and Prayers of the Clerics of Northshire\".{/col}\n\n\n{h3:c}{col:161616}Worgen Appearance{/col}{/h3}\n{col:ffffff}Though somewhat shorter than most other male worgen, Dean still reaches their height since his stance isn't hunched whatsoever. In fact, he'd probably look more like a female of his kin.\n\nSlender, almost lanky, with a fur-tone the same as his hair colour, except for the lighter patches by his hands, chest and snout. His fangs, sharp-looking on either sides of his snout, the ones up front somewhat sturdier.\n\nClear green eyes peek out at people with curiousity and lopsided ears flick along with every noise that seems out of the ordinary. His nose twitching every now and then at the scents around him.{/col}\n\n",
				},
			},
			["zone"] = "City of Ironforge - The Military Ward",
		},
