				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}{icon:Spell_Mage_Evanesce:25}{/h1}\n{h1:c}Cassandra Hawk{/h1}\n{p:c}{col:9d3cff}\nCassandra's face is what one could describe as timeless, giving no real indication towards her age. Her eyes are emerald green, almost glowing in contrast to her pale skin. Moreover, her face carries thin lips and a small perky nose. Dark red hair frames her face, being allowed to hang freely. A tall and rather slim woman, carrying a good posture. She often walks in a moderate pace, perhaps being slightly more rigid in her walk compared to the average woman.{/p}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n\n{h1:c}{icon:INV_Staff_90:25}{/h1}\n{h1:c}The Staff{/h1}\n{p:c}\n{col:9d3cff}Cassandra carries a large wooden staff, seemingly carved to resemble some kind of bird. One may note that it is very well made, likely by someone with excellent carpenting skills, as it is quite rich with detail. Furthermore, it is larger than the average staff. Although it is likely to pique the interest of most, one may find it to have a rather ominous presence. \n\nThe top part of the staff is shaped as a bird's head, having all manner of details to it. For the bird experts, it would certainly have the features of some kind of predator bird, yet it would not be relatable to any species in particular. Two octagon sapphire crystals are imbued into the wood eye pattern, which constantly emit a faint and pleasant blue glow. \n\n A thicker cylindrical wooden region connects the head to the shaft, which is seemingly imbued with several emerald crystals, all of which look to have the exact same shape and spacing. The shaft itself is long and uniform,  completely wrapped in purple cloth ribbons. Two large and white feathers are attached along it, in rather arbitrary locations .  \n\nThe bottom part of the staff was carved to resemble a talon, from which a short and thin metal chain hangs, carrying a single feather. Just like the head, the talon is connected to the shaft by a thicker cylindrical region, seemingly identical to the upper one. \n{/col}{/p}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n\n{h1:c}{icon:Achievement_KirinTor_Offensive:25}{/h1}\n{h1:c}Career{/h1}\n{p:c}{col:9d3cff} \nCassandra lived most of her life in Dalaran, learning the ways of magic since the age of twelve. At the age of twenty two, Cassandra began her research which she pursues to this day. For some, her research is perceived as promising, whilst others may deem it as controversial. Parallel to her research, Cassandra has also helped the Kirin Tor whenever there was a need for her, be it on the field or as an instructor of illusionary magic and transmutation. Furthermore, Cassandra has also published some of her work, all of which can be found in Dalaran.  .{/col} {/p}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{img:Interface\\Pictures\\artifactbook-mage-cover:256:256}\n\n\n\n{p:c}{col:4f237e}\"Close your eyes and watch a new world unravel.\"{/p}\n",
				},
