						["TI"] = "Shadowstalker's Guise",
						["AC"] = true,
						["TX"] = "Eight dashes of striped, lavender ink radiates outwards from the nose.\n\nDisciples of the Path of Shadows make fearsome killers. Tribal customs of the Eternal Winter say each stripe represents a legendary kill over the millennia.",
					},
					["3"] = {
						["IC"] = "ability_rogue_sanguinaryvein",
						["TI"] = "Illyanna's Integrity",
						["AC"] = true,
						["TX"] = "The faded scars of a hundred lashes mar the warrioress's back, never to heal.\n\nThe Ravenoak Sentinels vowed never to fail their own: the choice of punishment was dishonourable discharge, or lashes equal to a hundreth of the fallen's age. Only the most dedicated remained.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Fang of Cerugosa",
						["IC"] = "INV_misc_blacksaberonfang",
						["TX"] = "Fang of the dragon Cerugosa of Mazthoril, maddened on her watch.\n\nThe Eternal Winter refined the dragon; her claws bathed in blood of elves. A novice girl was cast out to hunt the beast; unexpectedly, a woman returned.",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Pelt of the Great Worg",
						["IC"] = "Ability_Mount_BlackDireWolf",
						["TX"] = "Cloak of Urgald, the Great Worg, enslaved by the forces of Hellscream.\n\nFreed during the Siege, the maddened Worg slaughtered its captors with suicidal savagery. Its terrifying visage lives on to revel in the blood of a thousand more hunts beyond the grave.",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "She Who Walks the Sand",
						["IC"] = "INV_Misc_AhnQirajTrinket_02",
						["TX"] = "Faded tattooes coils around the warrioress's limbs and neck in the insectoid styling of silithid.\n\nThousands died culling the silithid threat of the Shifting Sands. Few survived it all; most wish they hadn't. The grizzled heroes earned the moniker 'Sandstrider' and embraced the legend to its fullest.",
