			},
			["about"] = {
				["v"] = 28,
				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Blizzard:512:128}\n{h3:c}An indigo flush makes the warrioress's wild mane, finely meshed against her violaceous skin. Slyly swift, precisely plucked eyebrows top shifty eyes on her heart-shaped visage, crowning a bud of a nose and her lips, as plum as plump.\n\nLilac marks graze Ilysalora's face in the Path of the Shadows: per tribal tradition, each stripe represents one great kill; she carries no less than eight, ink swathed across her visage. Faded scars mar the soldier; ink in the style of silithid coil around her limbs from neck to knee in eternal struggle.\n\nBy providence blessed with warrior's height, she has strength to match: rippling muscles over scarred skin is a habitual boast of a sight, wordlessly professing the slavish training that makes her toned figure possible. With teeth, tongue and stare as sharp as her blades, conflict has bred this character.{/h3}\n",
