			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{p:c}Artwork{/p}\n{link*http://i.imgur.com/5M5lIg7.png*quick refrence Kirin tor garb}\n\n{link*http://i.imgur.com/0l46su0.jpg*Portrait off Krisstie}\n{link*http://imgur.com/iMtuRFU*Worgen form}\n{p:c}Artists{/p}\n{link*http://grahellart.deviantart.com/*Grahell}Made portrait and Krissties worgen form\n{link*https://twitter.com/arlathans/status/827392373076340737*Safmira} Made Krisstie's Kirin tor garb\n\n\n{p:c}Discription{col:000000}{/col}{/p}\nKrisstiana  Quellette Bronzebrew\n\nIs a rather small, skinny young woman.  She has beautiful black hair, though .  It sits shoulder length and curled inward at the ends with a side parting.  She keeps it neatly groomed.\n\nIf you ever see her pull up her sleeves, you will notice a cloth covering Krisstie's right arm.  She uses this to cover the wound where she was bitten and cursed as a worgen long ago.\nKrisstie bears a facial tattoo under her right eye that signifies she is an official Wildhammer under Clan Drakehammer.  It is a single line with two downward-pointing triangles in purple ink.  She also has a lightening bolt around her right arm with a circle of runes above and below it which glimmer.\n\nKrisstie's eyes are completely black, as if her pupils have dilated to cover the entirety of her eye.  All along her left arm she has a large scar with a chunk missing where she was bitten by something apparently quite large.\n\nKrisstie also wears of large chain with sixteen crosses attached to it which all shine red.\n\n(Weaponry)\nOsa'merlorn: Krisstie's enchanted Steel sword comes with a finely made leather sheat made form tough worg skin\nOsa'merlorn's handle can be held with either one our both hands it has a sturdy well made hand guard and a bronze thunderbold running along its spine with the engraveings Osa'merlorn inscribed on it yet once the sword is drawn form its sheat it freezes the air around it forming thick layers off ice ontop off the sword maintaining a icey sharp edge followed by small shards off ice created form the cold it self around the sword that drop on the ground \n\nDagger:Krisstie always  has a simple steel dagger  straped to her belt \n\nStaff: Krissties staff comes to close her own body's height with a qeustion marked curved top with one bright blue crystall hovering within the center off the curved top on the buttom the same shape has been repeated in a mirrored state with a smaller bright blue orb both the top and bottom off the staff are covered in a strong white golden elfen steel  with on the top side several smaller crystalls shards inplaced and a firm strong wooden handle in the center \n\n(Kirin Tor robes)\nKrisstie'often wears her new robes she recieved after becoming part off the Kirin Tor and comes with the surcoat off the Kirin Tor The robes are made form a fine yet strong silk  with several sockets with bright blue gems inplaced into  them that have fulled with cryomancy given her robes a cold feel form the outside  aswel as boosting her cryomancy witch coulds for her gloves and boots aswel her shoulder pats have been renforced with a light strong metal and several crystals sticking out on its sides chilling the air around them with abit off cryomancy  and large sphere on the center off the shoulder pats that have several shards off ice floating out off it (W.I.P)\n\n(misc)\nkristy carryins a beautifull simple leather satchel over her shoulder cotaining her scribing kit and tools aswell as a small wooden firstaidkit\na small herb poach on her rear\nA small pink satchel with a heart shaped buttons rests on the front off her belt \nshe carrys a prayer book on her belt\n\n\n\n{p:c}Personality traits{/p}\nKrisstie tends to keep her self alone most off the time for so she can study in peace and for calmed prefering small groups off people over big groups so she can study alone and in peace and not distured for annything as she dislikes sutch.Krisstie rarely shareing her full name as she may has started to be more kind towards others willing to give them a chance she will almost never trust anny one on a short our medium term of knowing them .she will be polite and kind to the people she knows and meets yet she will hold a hate full grudge to annyone that harms her trust our annyone that hurts her  family .with the things shes been trough and seen krisstie has gained quite a severe cause of ptsd\n\n\n\n(history){icon:SPELL_HOLY_BORROWEDTIME:25}\n\na few days after her birth she was removed form her parents and placed on the door step of an  \nislolated abby were she grew up never allowed to leave the abby and tought the basics of healing with the light along with writeng  reading and tailoring and how to take care of her self  \n\nform the priesteses during the worgen curse spread the abby was under attack of witch the other priestesses were either slain our bitten and gone to far feral to save \n\nshe her self got saved by Hrodulf Davenport right after she got bitten were they sneaked around gilneas until Krisstiana turned and bit  Hrodulf Davenport before reaching the druids who offered them part of the ceromony afterwards they traveled to darnassus  where they stayed for a while  after some time they decided to travel to stormwind and head south for westtfal to stay in relatief peace where she met her sister who remember her being taken away \n\nafter a few nice weeks of live krisstiana was kidnapped and forced into slavery witch took most of her shyness into hatred and distrust in others and compleetly lost everything when she finaly was freed and headed to her current home only to find Hrodulf Davenport dying her her arms \n\nafter witch she burried him she took everything she had and left to hide until offered safety by a warlock who teached her the basic of shadow magic \n\nand now she now travels around azaroth to find and learn more about shadow magic and items to strengten  her magic after she lived in a cave near karazhan\nresting and practiceing she was called to ironforge by her teacher to meet a friend of his called Gwetha lue BronzeBrew that later addopted Krisstiana into her family where Krisstiana in time felt home in starting to feel her old self again instead of being so cold to the people around her gaining faith back in the light as the people she cares for get hurt quite often learning how to use it form an older priestess in witcht she met and dreanei name keirazar that kristy looks up to as keirazar teaches her about herbalism and inscription becoming her apprantice studying under her due too some issues Krisstie changed her ways in magic becomeing Kee's apprentice in transmutation magic aswel with several trips too dalaran she got into contact with a magister who brough Krisstie withing there ranks still studying under kee and doing what she can too keep those she cares about safe form the legion\n\n\n\n\n\n\n\n\n\n\n",
				},
