			},
			["character"] = {
				["CO"] = "> Art & AA link in \"About\" section.\n> Red dot? Then I'm OOC.\n> Otherwise approachable.\n\n",
				["RP"] = 2,
				["v"] = 71,
				["XP"] = 2,
				["CU"] = "> Slight mark upon neck; mostly hidden by hair.\n> Carries the faint smell of rotting flesh about her.",
			},
			["about"] = {
				["v"] = 80,
				["BK"] = 9,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}Elena Darrowe{/h1}\n{p:c}{link*http://i.imgur.com/pxBZEPg.jpg*Elaine Artwork}{/p}\n{h2:c}{icon:ABILITY_Rogue_ThiefsBargain:25}{/h2}\n{p:c}{col:ff8f24}\"Making friends is far more profitable than making enemies.\"{/col}{/p}\n\n\n{p:c}{col:f91d07}A female of a slender shape and light caramel skin, of which appears unblemished apart from the intricate web of tattoos inked into the flesh of her arms and back. If granted the opportunity to closely inspect the art, it could possibly be recognisable to that of a map of some kind, or perhaps several linked together. Such is however mostly covered by her attire; as it seems to be, she prefers clothing with longer sleeves. A wound sits over her heart; a noticeable \"X\" shape, which seems to have been carved by a sharp implement. This can often be seen when cleavage is displayed.\n\nVibrant green eyes are encircled by thick lashes and black lines of khol. Slightly fuller lips sit in a nautral pout, untouched by cosmetics yet holding a naturally darker shade. Waves of ebony hair often fall loosely down to the incline of her waist, however such can be tied back depending on her overall mood. Her ears are adorned with multple rings of pure silver, from lobe to cartilage, all appearing to be clean and well managed. The woman appears to favour looking after her appearance, and no doubt such tastes are expensive.\n\nHer facial features could be considered exotic to a degree, as if mixed heritage is present within her bloodline. Her accent holds a light Southern lilt, yet her words are articulated and precise, giving confirmation that education played a part in her life.{/col}{/p}\n\n{p:c}{link*https://www.argentarchives.org/node/191224*Character AA}  \n\n{link*https://www.argentarchives.org/node/191033?*Guild AA}{/p}\n\n\n{h3:c}Appearance Summary:{/h3}\n\n{p:c}{col:ff7d57}- Looks around early to mid twenties.\n- Tall & slender figure.\n- Light caramel skin.\n- Green eyes.\n- Heavy eyeliner.\n- Waist-length black hair.\n- Pierced ears.\n- Tattooed arms & back.\n- \"X\" scar on chest.{/col}{/p}\n\n {img:Interface\\Pictures\\artifactbook-rogue-cover:256:256}\n\n",
				},
			},
		},
