						["IC"] = "Achievement_Win_Gilneas",
						["TI"] = "Accent",
						["TX"] = "Although a proud Gilnean, her accent is not quite as severe as that of some others of her country men. She still lapses from time to time, but it's getting increasingly rare these days. ",
