						["TI"] = "Homespun",
						["IC"] = "Item_spellcloththread",
						["TX"] = "Her clothes are plain and and made of simple fabrics, with neat hand-stitched hems. Most likely she made them herself.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Silver Necklace",
						["TX"] = "Her old locket is gone and has been replaced with a necklace featuring a beautiful red gemstone and a delicate silver chain.",
						["IC"] = "INV_Jewelry_Necklace_62",
					},
				},
				["v"] = 36,
			},
			["time"] = 1499273952,
			["zone"] = "Stormwind City - Mage Quarter",
			["about"] = {
				["T1"] = {
					["TX"] = "   {p:c}Apprearance:{/p}\n\nNaryane is a rather short and stout woman. She is about a head shorter than your average woman and she has a figure that is curvy and soft around the edges from tasting her own cooking.  She has a fairly large bosom and wide hips but tends to hide her form in plain dresses and crisp white aprons. \n\nHer hair is long, reaching down to about her waist and it's a dark red color. Most times it is tied back, either in a bun or in a braid, to keep it out of her face while she cleans or cooks.\n\nAlthough she does not consider herself beautiful, she has a fairly pretty face with lovely eyes and high cheekbones. However, many years of working hard and taking care of people around her has left her looking tired and worn. She has worry lines etched into her face around her eyes and mouth and sometimes she is also seen with dark circles around her eyes.\n\n{link*http://imgur.com/gJrhkYZ*A portrait of Naryane painted seven years ago.}\n\n\nWorgen form:\n\nShe is very rarely seen in this form anymore. It holds too many memories, and she prefers the feeling of self-control she has when she appears human.\n\nShe is very short compared to the average worgen female and once again she remains soft around the edges but it is a bit harder to tell with the thick grey fur covering her body. Her mane has lost it's dark red color but it remains long and it is often tied up with brass rings.\nEven in this form it is clear to anyone that looks that she has been through a lot. Her eyes often look tired and sometimes her smile doesn't reach all the way.\n\nShe carries herself proudly, both in human and worgen form, and she tends to greet anyone she meets with a smile.\n\n \n\n{p:c}{col:3b6517}Background:{/col}\n{/p}\n\nMany events in Naryane's past have scarred her deeply and forced her to grow up a lot faster than any girl should have to. Because of this she seems and acts a lot older than she really is and even at this age she is weary of the world. But no matter how much another person might try to pry into her past, she refuses to tell anyone, determined to live in the present and make it the best she can. Rather that than dwelling on things long gone.\n\nShe has, however, written about most of these events in her Journal, but the chance of ever getting to have a look at those worn pages is incredibly slim.\n\n\n\n",
				},
