			["about"] = {
				["T2"] = {
					{
						["TX"] = "< Appearance >\n\nQuite penny-plain in comparison, Amily holds no particular uniqueness. Her thick, blonde, unruly locks swooped to one side in a careless manner. The girl's absent-minded expression usually a picture of senselessness with olive eyes that hold weary bags and a hazy glaze. Cheekbones hollow enough to cast a natural shadowed contour; the only feminine product on the girls face is numerous coats of mascara to enhance the length of her lashes, sable eyeshadow smudged around her jaded orbs and lips stained with cheap scarlet lipstick.  \n\nAmily's willowy figure is that of an hourglass, with broader shoulders and wider hips. The girl's physical form, though curvaceous, is spindly. Her ribs and spine moderately visible to the eyes of a beholder. Lacking neither scars or blemishes, it's easily assumed that she is no fighter. The only permanent marking on her body is that of her inked right thigh, her tattoo of the Stormwind Lion. ",
						["BK"] = 5,
						["IC"] = "Achievement_Character_Human_Female",
					}, -- [1]
					{
						["TX"] = "< Personality >\n\nA façade that rarely falters, this girl may not be knowledgeable in the world's affairs but is savvy enough to stay afloat amongst the belligerent city-folk. It's as if the girl is telling you whatever you wish to hear, seemingly an expertise in the arts of lying and manipulation.  \n\nBarely a dame, in any shape or form, her social etiquette is limited to that of her own social-class. ",
