		["0225181140PW$VF"] = {
			["character"] = {
				["CO"] = "Friendly, approachable.\n",
				["RP"] = 2,
				["CU"] = "A week's passed. Morgan's recovered quite nicely. His facial hair is neatly put up again.",
				["XP"] = 2,
				["v"] = 97,
			},
			["time"] = 1499202345,
			["zone"] = "Shimmering Expanse - The Lightless Reaches",
			["about"] = {
				["v"] = 4,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}A short rundown{/h1}\n\nMorgan Branzenbeard; as a wee laddie he has always been fascinated by the stories and adventures of Harrison Jones, Brann Bronzebeard and alike!\n\nSeasoned through Dwarven Military he has been taught his combat skills, a veteran Mountain King named Thorgas Broadaxe lend his combat skills to one of the many Dwarven Devisions.\n\nFighting for the Eastern Kingdown earnt Morgan his armor, which he cherishes and carries around up to today, even after retiring from the Military for decades.\n\nAlso as a reward after retiring from his devision, Morgan received his to-be companion for life, Sigrid the purebreed Stormpike Battle Charger. He raised her and traveled everywhere with her. This continued until recently, when he wanted to retire his proud hoover. Unfortunately an expedition-gone-sour thought differently of that, raiding Vrykul managed to wound Sigrid, and give her a near peaceful instant death. Morgan moarns his loss up to today.\n\n\n{h1:c}General Discription{/h1}\n\nMorgan is a pretty average Dwarf; he's bulky, fit, loves beer and has a huge beard!\nHe usually braids part of his almost red 'stache and beard, not too crazily, just the right amount.\nHis physique is in good condition, but he loves his mead! So his belly might just poke out a little bit.\n\nAll the rest you'll see when you look at him!",
