		["0610172809T5Ij4"] = {
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Appearance!",
						["IC"] = "Ability_Fixated_State_Red",
						["TX"] = "Her dark hair and pale skin could make her quite abnormal, but overall, she's pretty. To some.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Personality!",
						["IC"] = "INV_Misc_Gem_X4_Rare_Cut_Red",
						["TX"] = "Generally, Abby is a happy person! Though, she's easily angered. Don't get on her bad side.\n\nThere are occasions, when Abby'll just go completely silent. Not talk to anyone. It's probably best to watch out for her at those times. \n\nHer speech is generally fast... as are a lot of her traits. She's fast. Acts fast. She's also fidgetty. Almost paranoid, in a sense.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Tattoos!",
						["IC"] = "Ability_Iyyokuk_Bomb_Red",
						["TX"] = "So far, she only has one tattoo, which is a group of ravens flying, on the back of her right shoulder. The ravens look silhouetted, but they also seem to have bright green eyes.",
					},
					["5"] = {
						["IC"] = "INV_Misc_Bag_09_Red",
						["TI"] = "Satchel!",
						["AC"] = true,
						["TX"] = "Abby generally carries around a small satchel, filled with who-knows-what.",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Weaponry!",
						["IC"] = "INV_Sword_1H_EbonBlade_B_01_Red",
						["TX"] = "Most of the time, Abby can be seen with some form of ranged weapon on her - be it a gun, a crossbow, or a bow.",
					},
				},
				["ST"] = {
					["1"] = 2,
					["3"] = 3,
					["2"] = 1,
					["5"] = 4,
					["4"] = 1,
					["6"] = 1,
				},
				["v"] = 55,
			},
			["link"] = {
				["Abïgaïl-ArgentDawn"] = 1,
			},
			["about"] = {
				["v"] = 18,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}{col:ff0900}Abby Bucknell{/h1}{/col}\n\n{img:Interface\\Pictures\\artifactbook-hunter-cover:256:256}\n\n{h2}{col:a7000a}Backstory!{/col}{/h2}\n{col:7e0009}Hmm... where should I start...? Maybe at... I don't know... the beginning! Like any sane person would!\n\nAbby Bucknell was born on the 15th of August, twenty-five years ago. It's unknown of whereabouts. Well, that's what she says. Really, she does know. She's just embarrassed to be from Westfall.\n\nUntil about the age of six, Abby lived a relatively normal life! Well, as normal as it can be, in Azeroth. Y'know, with all the creepy monsters and shit. ANYWAY!\nAbout a week after her sixth birthday, Abby experienced her first \"tragedy\". If one could call it that. The death of her mother. It's unknown to Abby what caused it. All she knows, is that her mother's dead. Gone. Forever. Good riddance, as she HATED her mother.\n\nHer father would tell stories of Abby's mother. Abby loved her father - still does, though he too is now six feet underground, in the cemetery of Stormwind. He hated Abby. Wanted a boy. Well, you can't always have whatever you want, can you? As a result of this, Abby wasn't treated so well in her childhood.\n\nAbby's father lived until Abby herself was about seventeen. Then he snuffed it. Got himself charred to death. What a shame, right? \n\nFrom then, Abby's been pretty much alone. Wandering this both amazing and horrific world. Trying to better it, as well as herself. Wondering to herself: \"What the fuck's gonna happen next?\" Don't we all, Abby... don't we all... {/col}",
				},
			},
