		["0204172854k.;vH"] = {
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Rain:512:128}\n(A big thanks to Brynjor for writing this whole backstory from my much shorter background.)\n{h1:c}Background{/h1}\nSilverpine forest, looking on into the northern woodland through the valley pass, and the headlands just beyond, were home to many a farm; ones that were becoming increasingly needed in times of war.\nThough this ‘Horde’ had been defeated, and yet money was still being taken from Gilneas.\n\nBarynard Ashkin, and the rest of his family, in fact, were torn up about the war, and while their farm had been unscathed - the traitor king Perenolde had spared them that, at least - they were still unnerved by tales of a secession from this makeshift Alliance.\n All but Barynard, whose dissatisfaction with his lifestyle had come to a head, and now all of his thoughts were poised on the latest, more personal news, of him being successful in joining the City guard.\n A small tear is what it takes, sometimes, to make a much large gap; and a small tear is exactly what this was, as Bary followed his heart to the city, and the rest of them left to tend to the nation’s farms, providing for Gilneas, and the Alliance.\n\nWell, not anymore. What was it Genn said? Damn the Alliance? Sounds about right, though with this accursed wall being built, he may well be damning himself, instead. Or rather, damning us, more so.\n\nIt was well over, what? Six years since he said that? How the time flies, especially with civil unrest being a new issue to deal with. Guarding the city had been fairly easy until then, but rumours of tension among the nobility are carrying the streets like a wind - if gossip were a force, the wall would have been destroyed ten times over.\n\nThough something was stirring, and whether Crowley liked it or not, the wall was being built. Of course, this would later be proven - and Crowley in fact did not like it. In the slightest.\n\n\n“Here they come,” A soft cry echoed by the northern bridge, the pass into the cathedral square, now barricaded by the bodies of a hundred ready loyalist soldiers, “hold your positions.”\n The order was given, and Barynard himself wondered why he was even here to begin with, let alone why he should stay. Though why became clear as the rumbling of stolen weaponry came over the ridges of the headland, and the smoke of bruning trees could be seen - a swathe cut into the Northgate woods, the thunderous mumurings of marching boots foretelling only one of two outcomes here.\n A victory, meaning the city was kept, or a loss. In which the city was taken, by Gilneans, no matter, but taken nonetheless. King Crowley. Doubt he’d suit the title.\n Though the reasons Bary now felt himself eager to leave wasn’t the cacophony of feet, or the thought of shedding Gilnean blood on the now rain-soaked fields, but rather each battle he saw simply increased the chances of meeting someone he really didn’t want to.\n While he took up the mantle, and with a proud tabard adorning his chest, his heart still felt bare, and rather cold in the wintry chill. A featureless face among many, and yet he could see him, even without laying eyes on the boy - his brother, definitely somewhere out there.  Either death or prison awaited him - or Barynard, come to think of it - and so in reality, the pit in his stomach was more than waranted.\n\n Though the pit, that empty, bottomless void in his demeanour felt all the heavier when they met. A clash of steel, or the rifles flashing, could not get the ringing from his ears when he finally saw him there. He didn’t even get the chance to do it himself, but he still remained unsure as to whether that would be better. Everything seems better at that moment.\n As bad as it is, finding that one so close has not only chosen the wrong side - if there is even a right side - but with his death marked the final push to turn the steadily growing ‘small’ tear into a gaping rift - one that no bridge could fix, and soon one that not even the Great Sea could fill.\n\n That was before the Scourge even - what could be worse than a war between brothers? - And before... They appeared. Whatever they were, beasts, worgs in all but one thing. The beasts overran them, taking not just the city, but the defender's very humanity. A bitter thought indeed, as Barynard waited in the stocks.\n\nThe Forsaken came next. Well, in fact it was the Cataclysm that came first, but who was keeping track at this point? So much in so little time - seven years seemed to pass in a blur. Though, a Gilnean he still was, and Barynard fought to the nines as he should have. \n While he in the end left the siege, he watched from the stern of the kaldorei ships, the city burned and he carried nothing with him but a sword and his brother’s memory. And it was these things he kept with him, until he, like so many others, left the home they had made for themselves under the Howling Oak, setting sail once again for Stormwind.",
				},
