			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Moonlight:512:128}\n{p:c}{col:ffffff}A tall, handsome elven woman. Her shoulders \nare wide, her waist thin and hips just a little wider than the \nshoulders, giving her body some femininity. She is quite literally a \nbit big-boned, but has very little body fat. As night elves often \ntend to be, she is quite muscular, but not in an at all bulky way.\n\nGiladris has a diamond-shaped face; angular, widest at the \ntemples and somewhat bony. Her cheekbones are \nwell-defined, the most likely bits of her face to catch the\nlooker's attention. Her skin is peachy pale, hair pure white and \nwavy, and her eyes reflect the silvery light of the White Lady.\nAround the starlit orbs, two lavender-colored maple \nleaves decorate her face. In addition to that, silvery lines have\nbeen tattooed around her wrists, almost like jewelery.\n\nThe priestess carries herself with grace, her movements subtle \nand feminine, bringing to mind a housecat rather than a saber \non the prowl. She tends to look into your eyes, almost intrusively,\nbut her usual warm, gentle smile should to do soften the effect.{/col}{/p}",
