			["link"] = {
				["Evangaline-ArgentDawn"] = 1,
			},
			["about"] = {
				["v"] = 2,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "https://tinyurl.com/grvt7re\n\nEvangaline speaks with a foreign accent, a distant form of alteracian lingering on her words, this estranged nature reinforces her stoic and near apathetic personality. Always gazing at others with half lidded eyes, she would seem unamused by everything, not even offering a smile to a greeting, the most expression she might ever show another person would be the disapproving quirk of a brow or a sneer of her blackened lips.\n\nShe is in fact, Undead. you would'nt know that from looking at her however. Despite being remarkably pale, she stands with a perfect posture, straight backed and alert to everything around her. If ever she were to remove her spectacles one would see the distinct blackenned sclera that permeates her undead corruption around the deep indigo of her pupils.\n\nHowever, the hints to her undeath are well hidden  by the painstaking attention she spends on her appearance, the pride she takes in maintaining herself it makes her near impossible to identify as anything other than a well postured, well garbed Human. With an attire much akin to that of a woman working within the profession of a Doctor, she would have an ample cloak that drapes her wirey form, within which she wears a formal white blouse and waistcoat, following down into a belt that holsters a plethora of her physician tools, but most importantly is an ornate, intricately crafted plague mask which she is frequently seen wearing.\n\n--------------------------------------------------------------------------------------------------------\nI will not tolerate people meta-gaming their way into figuring out Eva's undeath. If you have a legitimate reason to try and persecute her for being undead, then be sure you have a valid reason for even suspecting her to start with, as without prior knowledge, it is near impossible to identify her as one.\n\n\nIf Evangaline is giving you a medical examination, please whisper me the results of any test she applies, Heart rate/Blood pressure/BMI/height/weight ect",
