					["PH"] = {
						["IC"] = "Ability_Warrior_StrengthOfArms",
						["BK"] = 1,
						["TX"] = "Naldris follows the typical image of a Kaldorei, sporting a height slightly taller than the average elf, alongside a lean, muscular figure. \n\nHer face is surprisingly unblemished and soft in features, with a pointed little nose  and healthy lips usually draped into a smile, although with no obvious laugh lines it's a recent feature. \n\nShe taken to adorning herself with a colourful scarf, clad in a soft orange colour, breaking into a lighter hue of orange in a pattern of waves.\n\nIn what is likely a stark contrast to her face, she has a tendency of overcovering the rest of her body in simple wrapping or bandages. Her arms, especially after the elbow, always seems to be covered in something. She mirrors this tendency on her legs.",
