			},
			["about"] = {
				["v"] = 49,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1:c}{col:b3e8ff}Tasaleil Hailey{/col}{/h1}\n\n{h2:c}{icon:INV_Pet_Raccoon:25}{/h2}\n\n{p:c}{col:7da8ff}The woman before you isn't quite average height, but she's not short enough to be considered a Dwarf, luckily. Her physique is considered more lithe, rather than petite, though from certain aspects it could be thought as more petite. It's clear from her features that she holds her youth quite well. Her cheekbones placed high, enhancing her freckle littered face. Her lips having a certain \"puffiness\" about them; with holding a somewhat half-smirk. As if only she understood that one joke that time. From her scalp is a mane of black locks, though on some occasions; commonly in the sunlight, one could probably see it as a blend of ebon and chestnut. The hair waves past her shoulders, and slightly past her collarbone, framing her face when let down. Her eyes are a vivid green, with specks of brown and blue, making them seem more hazel, then finished off with some fine, dark and curled lashes. Her nose is thin, but is quite clearly a button nose.\n\nTasaleil has been shown as feisty and sassy, quite commonly quick with one-liners or an insult, maybe two. Even so, she's not necessarily cruel. She's frequently underestimated due to her small size, but she uses that for her fast thinking. Remaining calm during a crisis, and pretends not to be easily traumatized.{/col}{/p}\n\n{p:r}{col:7da8ff}Visual Reference: Diane Guerrero.{/col}{/p}\n",
