						["AC"] = true,
						["TI"] = "Padded Satchel",
						["TX"] = "A large leather satchel is attached firmly to the left of her belt. The clinking of glass sometimes echoes from within. This clinking is accompanied by the jingling of loose change, originating from one of two pouches that hang besides.",
						["IC"] = "INV_Misc_Bag_05",
