					["3"] = {
						["AC"] = true,
						["TI"] = "Equipment",
						["TX"] = "A curious dagger of orcish origin rests in a sheath at her right hip, next to a coil of rope. A steel boomerang is tucked behind her belt, emblazoned with the fond symbol of Darnassus.",
						["IC"] = "ABILITY_Rogue_PlunderArmor",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Mithril Sword",
						["TX"] = "Careful vine-like patterns criss-cross the blade, matched by those that coat the sheath.  'Anu'dorini Talah' cuts across the blade's spine; Darnassian for 'Let my will be known'.",
						["IC"] = "Ability_Warrior_Revenge",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Bird Whistle",
						["IC"] = "Ability_Hunter_BeastCall",
						["TX"] = "Though peculiar in shape, the pine whistle has been specifically designed to mimic the sound of a bird. It stays hooked to a chain that Ydanil keeps around her neck.",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Headdress",
						["IC"] = "INV_Helmet_19",
						["TX"] = "Sticking out in regal fashion from the wings of her sentinel headdress are four silver-lined moonkin feathers; two on each wing. The left wing beholds an additional mud-brown plainstrider feather.",
					},
				},
				["v"] = 8,
			},
			["time"] = 1499643271,
			["zone"] = "Feralas - Feathermoon Stronghold",
			["about"] = {
				["T1"] = {
					["TX"] = "An unswerving figure; broad shoulders and thick legs- a naturally athletic build structured with compact muscle. Slightly shorter than average, her head is kept held high regardless, carrying herself with an at-ease confidence.\n\nThick shaped brows rest on her forehead, dimly lit with the amber glow of her eyes. The orange-gold phosphorescence rests in silence under a pair of long, dark eyelashes, the druidic potential present yet dormant; ignored. The rest of her features are sharp, jaw and nose angular and cheekbones clearly set below an aquiline and deep-set gaze, but they often look tired, weary and worn. Dark circles frame her eyes as a consequence of her insomniatic sleeping tendencies.\n\nThe former wounds scattered across her skin are outshone by a discoloured scar  that runs with ill-intent between two of her ribs, jagged and edging out into the centre of her torso. Unnaturally dark in pigment, it's clear this wound was the product of an evil, magical source. Similarly, patches of her skin show slightly darkened tones, though this notation proves to be beyond the peripheral, requiring extremely close inspection as they blend out into the rest of her skin. \n\nHer hands, rough and scarred maintain a sense of elegance- still and controlled, like the rest of her movements seem to be. She seems to resonate calm, her smiles carefully practiced and warmly thrown, however brief- but she cannot shake off a sense of aloof detachment and similarly growing listlessness.\n\nRecently, her body has lost muscle mass; she's thinner and weaker than she was before. She's also more pale, looking more tired than usual.",
				},
