			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "============================================================\nDescripton:\n============================================================\n\nA young looking Tauren, shaggy short fur and hazel eyes. He looks to be in his late adolesence, a messy tuft of facial stubble and a small beard holds his nose and broad chin together. \nHe dons hide and leather, a leather and fur tunic over his chest. His lower body is covered in rough hide pants. A worn axe is held over his back on a strap and several pouches cover his belt.\n\n===========================================================\nPersonality\n===========================================================\n\nAs typical for most of his kind, Tocho embodies the 'strong and silent type'. Generally keeping to himself he is slow to warm to new folk, prefurring to let his actions speak more then words.\n \n=========================================================\nHistory\n===========================================================\n\nAsk IC if interested!\n\n============================================================\nFAQ\n============================================================\n\nQ: Are you really RPing as a Tauren?\nA: Yep, I believe the interaction and roleplay that can be gained from it is both unique and exciting!\n\nQ: Are you a serious roleplayer?\nA: Yes, as strange and unique as this character is on the alliance side like said above I believe it can give way to interesting roleplay.\n\nQ: What item do you use.\nA: Two, reflecting prism and the orb of deception. \n\nQ: How do you maintain the Tauren look\nA: I have a trial account alt (Please ignore if you can see it) so I can cast the reflecting prism on.\n============================================================",
