		["02260434566KGHf"] = {
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Peculiar Eyes",
						["IC"] = "INV_Misc_Eye_04",
						["TX"] = "When attention is on Flynn, it is often drawn to his eyes.\n\nThe colour of his eyes sits at a distinctive light grey, accompanied by abnormal bright flecks that decorate the border of his pupils, making his irises appear silver under certain light.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Well Groomed",
						["IC"] = "INV_Shirt_17",
						["TX"] = "Flynn is almost always emitting a fresh aroma and can be seen in fancy attire.\n\nThe armour he wears is known to glimmer under light and the fabrics he fashions are neat and nicely sewn.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Stag Embellishment",
						["IC"] = "DRUID_STAGSTATUE01",
						["TX"] = "Anything Flynn wears, ranging from armour to fine cloth will be adorned with the symbol of a Stag. This is to represent the sigil of his family.",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Weaponry",
						["TX"] = "Flynn carries an ancestral bastard sword forged out of truesteel. The black hilt is covered in rubies, indicating its Braxian heritage.\n\nA hidden shortsword is also strung up on his lowerback that sits in a sheathe, it is fashioned by the same type of gems with the metal being identical to the bastard sword.",
						["IC"] = "TRADE_ARCHAEOLOGY_NOTCHEDSWORD",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Coin Purses",
						["IC"] = "inv_misc_coinbag_special",
						["TX"] = "Around Flynn's waist is three coin purses.\n\nEach pouch assorted accordingly being filled with a different type of coin; copper, silver and gold.\n\nThe amount of coins in a pouch depends on the type of coin.",
					},
				},
				["ST"] = {
					["1"] = 2,
					["3"] = 3,
					["2"] = 1,
					["5"] = 4,
