			["link"] = {
				["Flÿnn-ArgentDawn"] = 1,
			},
			["characteristics"] = {
				["LN"] = "\"Lupus\" Braxian",
				["MI"] = {
				},
				["PS"] = {
				},
				["AG"] = "28",
				["IC"] = "Ability_Warrior_Incite",
				["EH"] = "ada3a3",
				["HE"] = "196cm",
				["CH"] = "ffcb71",
				["RA"] = "Stromic",
				["RE"] = "Staghearth",
				["v"] = 22,
				["BP"] = "Arathi Highlands",
				["CL"] = "Warrior",
				["FT"] = "Count of Audia - The Black Stag - Champion of the Braxians",
				["FN"] = "Flynn",
				["TI"] = "Count",
				["EC"] = "Silver",
				["WE"] = "Muscular",
			},
			["character"] = {
				["CO"] = "",
				["RP"] = 1,
				["CU"] = "Several scratches across his full figure - bruising and grazes map his face along with the mark of a busted lip.",
				["XP"] = 2,
				["v"] = 88,
			},
			["about"] = {
				["BK"] = 19,
				["T3"] = {
					["PH"] = {
						["IC"] = "Ability_HanzandFranz_BodySlam",
						["BK"] = 7,
						["TX"] = "The man before you is straightened at full height, Flynn stands at six feet, four inches tall. He appears to be a defined, heavily built man, indicating years of hard training and incredible resilience.\n\nHe bears thick, dark brown hair which often seems quite straggly due to its wavy texture, occasionally even mistaken for a purely black colour depending on the lighting, it is abundantly growing on both his head and his face, causing his silver eyes to exaggerate in comparison to such a dark colour. This palette seems to naturally mix with his fair complexion, possibly rendering him appealing to one's eyes.\n\nUpon closer inspection, one may notice that he lacks any sort of peculiar markings except for a rather large scar resembling the slashing of bear claw that runs down his cheekbone to his jaw.",
					},
					["PS"] = {
						["IC"] = "Spell_Nature_CrystalBall",
						["BK"] = 1,
					},
					["HI"] = {
						["IC"] = "INV_Artifact_tome02",
						["BK"] = 7,
						["TX"] = "Very little is known about Flynn's past before the Braxian family took him into their home, other than that his birth name was Flynn Liekos. He was born a descendant of a dying noble Stromic bloodline whom had become nothing more than a fishing family in the Highlands, he was found in his dying mother's arms - behind a withering tree near the main road that cuts through the middle of the Highlands by the Braxians when he was no older than two (Nothing is known about other family members) and he was adopted into the Braxian household, becoming an official member by the age of four.\n\nHe had five brothers, four of which despised him. Titus Braxian was the only one who had taken a liking to Flynn; these two shared a bond because Titus was the only Braxian child that was willing to see Flynn as a real brother, they shared interests, hobbies and humour. Because of the bond crafted between the two brothers, Flynn had become undyingly loyal to Titus and made it his responsibility to take care of him no matter what - right up until Titus' death.\n\nDespite not being a part of the Braxian bloodline, he was still educated in academic subjects and combat, no different to any other highborn child. At the age of thirteen, his father Lord Braxian held a tournament for his children, a tournament that Flynn had become victorious in. He was named Champion of the Braxian household, knighted and given an adequate amount of gold and manpower for him to go travelling.\n\nDuring the ten years of his travels, he had learnt various fighting techniques from many different races: Kaldorei, Gnomes, Trolls, Tauren and others of the like making him an experienced combatant. He had then decided to spend two years roaming fighting pits and gladiator caravans, trying to figure out and master the fundamentals of his new combat style and beginning his path on creating an unpredictable combat pattern.\n\nHe returned home at the age of 24, only to find that his siblings and father were dead, all except for Salvador, and his closest brother Titus - the one brother who had shown love for Flynn during their childhood. Titus was now Count and Lord of the Braxian family whilst Flynn was named Viscount, next in line to the Braxian inheritance.\n",
					},
				},
				["TE"] = 3,
				["v"] = 14,
			},
			["zone"] = "Stormwind City - The Canals",
		},
		["[MSP]Rowina-ArgentDawn"] = {
