				["T3"] = {
					["PH"] = {
						["IC"] = "Ability_Warrior_StrengthOfArms",
						["BK"] = 1,
						["TX"] = "Tall and buxom, Rowina carries herself with with stately poise and an easy grace in both a gown and practical druidic leathers. She has a gleam of warmth in her eyes and a carefree half-smile tugging at the corners of her painted lips, and her extravagant gestures tell stories of experience in theatre and dramatics.\n\nHer fair skin and the strong slope of her jaw hint at Gilnean origins, but it is her clear-cut syllable accent and husky voice that remove all doubt.",
					},
					["HI"] = {
						["IC"] = "INV_Misc_Book_17",
						["BK"] = 1,
						["TX"] = "Rowina made a living on the stage, and may be recognised today by some fellow theatre-loving Gilneans who cross her path. She is excellent at her craft, and over the span of a decade she has appeared in dozens of grand stageplays and small, private shows for the wealthy. She has a wide range, but towards the end of her career she tended to shun any roles involving lovesick heroines.",
