			["about"] = {
				["BK"] = 8,
				["T3"] = {
					["PH"] = {
						["TX"] = "Her hair is black as the night and long, tied often into a tail that cascades down along her entire back. \n\n Her smouldering green eyes are darkly framed and recklessly glares at anyone that manages to infuriate or threaten her. They lie framed in a dark coal line, making the contrast between her tanned skin and green glare even more prominant. \n\nShe has a birthmark shaped as a crescent moon on her right hip, and a tattoo of a lily in shades of red orange and yellow at the front of her left thigh. \n\nAs far as scars go, the woman seems to have so far been lucky. Her back carries traces of faded lines from a lashing.\n\nShe carries two belts, one being a toolbelt with four deep pockets in total which carry basic medical supplies for emergency treatments. She always carries a flintlock and a concealed dagger on her person.\n",
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "Her sharpest weapon however is like it has always been, her tongue. Vicious, blunt and known generally for  speaking truth as she sees it. She is a fiery and passionate woman has turned spiteful and reckless. ",
						["BK"] = 1,
					},
					["HI"] = {
