				["TE"] = 1,
				["T1"] = {
					["TX"] = "{link*https://www.youtube.com/watch?v=b7rWs92CK7k*The closest Falerian has to a theme}\n\n\n{h1:c}Physical Description{/h1}\n\n\n*Lacking any traditional kaldorei markings on her freckled cheeks.\n*Falerian has her thick blue hair tied into a messy ponytail.\n*Wearing a pair of reading glassess, at all times.\n {link*http://imgur.com/J72TLCZ*Falerian, drawn by my close friend, Nicksy! Find him on Facebook at}\n {link*https://www.facebook.com/Nicksy-378207132328488/?fref=ts*Facebook Group}\n\n{link*https://imgur.com/a/MK4Zk*Anime Falerian!}\n\n{link*http://imgur.com/a/OBI3I*Pinup of Fally, relatively SFW}\n\n{h1:c}Personality{/h1}\nThirsty for knowledge whether she can find it, Falerian is ready to learn what people have to offer, even if it does tend to be mundane. Rather approachable, she is notably rather awkward when it comes to fellow kaldorei.\n\n{h1:c}History{/h1}\nFalerian has taken to the arcane arts, studying under the Shen'dralar. Concerned about her race's future, since the lost of immortality. While she still respects traditions such as Druidism, she believes that the survival of her people rests upon once again, magic.\nDespite becoming ostracised, she is still eager to learn what she can to aid her fellow kaldorei.\n",
				},
