				["TE"] = 1,
				["T1"] = {
					["TX"] = "{col:ffffff}Edgar stands a little over six feet atop the soil. A pale youthful man in his early prime with a sophisticated lifestyle. His crown draped over with tousled pale blonde, thick and lustrous hair. His features strong and defined, sharp jaw, chin and cheekbones molded from granite. On either side of his straight nose are two blazing hazel eyes. Spiked, warm brown fringed with smooth green sloped over with a set of graceful brows, thick and distinct.\n\nThe man's body alike an athletes. Healthy and taut in all the correct places with distinct sculptured contours that presented his chiseled chest and back. Edgar's profession and hobby leaving his once graceful and smooth to the touch hands with calloused patches of skin and quite often enough decorated with colourful specks of dried paint or smudges of natural pigment.\n\nEdgar carries himself with a positive expression, an idle smile eternally plastered across his  lips. His general appearance collects all into that of a charming and well presented man.\n\nHis voice honeyed and proud. Rich in volume, making the listener put all their trust into his sharp spoken words.{/col}\n\n\n\n{h3:c}{link*http://i.imgur.com/ak08tZ7.jpg*Art}{/h3}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:384:48}",
