			["about"] = {
				["T3"] = {
					["PH"] = {
						["TX"] = "Yariba looks like most other Draenei from afar. There isn't anything particularly special about her. Her tail, and other features, seem normal, though, on closer consideration, anyone could see that...\n\nYariba is somewhat under the average weight for a Draenei. Her muscles are not large, she does not express strength in her form, instead: finesse and agility. Her tendrils were also smaller than average, reaching just beyond her shoulders.\n\nShe wears a white headband to hold her hair in place. It's a dark violet, unkempt and often found with food, twigs and other flora and fauna.\n\nSummarily, she is normal, excluded the strange antlers and... 'decorations' in her hair. She is, despite these features, quite standard to the eye.\n\n(Physical Description is by: Daeion Ironleaf)",
