			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Antlers",
						["IC"] = "TRADE_ARCHAEOLOGY_ANTLEREDCLOAKCLASP",
						["TX"] = "A pair of antlers are seemingly stuck on her forehead. A small blue rose bound tightly on the upper part of the right antler, with some kind of plant parts. On the left antler there is a red rose with subtle glimmer to it's petals.\n\nMagic users:\nMay sense a faint magic, but it wasn't coming from the antlers, rather it was closely around them. The antlers themselves didn't feel magical at all. They looked and felt like any regular antler would. Perhaps they were enhanced by some kind of magic?",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Weapons",
						["IC"] = "INV_Staff_89",
						["TX"] = "-Usually a staff on her back, made out of simple wood. On it's upper end, a wooden animal head, with amber eyes and sharp antlers.\n\n-Always carries a dagger behind behind her belt.\n\n-When in armor: \nSomeone who paid attention to details could see that Yariba had two other daggers hidden behind her belt, and one in each of her gauntlets and boots. Seven daggers in total.\n\n-When in robe or other clothing:\nShe keeps most of her things in her bag, which she usually carries on her staff.",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Incomplete Armour",
						["IC"] = "INV_Shoulder_Leather_Panda_B_02_Brown",
						["TX"] = "Yariba's attire is strange to say the least, even without the antlers. \nShe wears a tattered leather tunic and pants, with several holes in them. \nWhile her shoulder guard, gauntlets and boots are plated, strong looking, but judging by her movements, not heavy. On closer consideration, they didn't look too thick either and seemingly, every piece was the work of a different smith. Another thing which might stand out is the wolf head on her belt.",
