				["WE"] = "Athletic",
			},
			["character"] = {
				["CO"] = "Feel free to approach!\n\nFace Reference - Léa Seydoux\n\nRecruitable!",
				["RP"] = 1,
				["CU"] = "Content. Walking about and minding her own business with a smile.",
				["XP"] = 2,
				["v"] = 23,
			},
			["about"] = {
				["v"] = 6,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "Face/Hair\n\nMargo appears to be blessed with fairly pleasant looks. Her skin is cream-coloured, and bears few blemishes besides a mole by the back of her jaw and a sparce smattering of freckles on the bridge of her nose, which sits in the middle of her face - thin, with a smooth downward curve to the tip. Her hair is raven in colour, and appears to be rather thick and volumous, being kept relatively neat in a parting which frames her face, sitting shoulder-length. Her large, almod-shaped eyes contrast her raven hair well, being of a particularly saturated violet colour. Her lips are untouched by makeup, but nonetheless remain fairly full and rosy. Her jaw is somewhat wide, and her chin is rounded and average in size. More often than not her expression carries with it a subtle pride and an overall bearing of content.\n\nArmor/Physique\n\nTypically one to trot around in her armor, Margo wears a set of plate covering just her vitals and shoulders, complimented by some sturdy brown leather, both of which cling to allow for a good amount of mobility. She is slightly taller than average for a woman of her race, and her physique is fairly ideal; lean, hard muscle spans her arms and legs, complimented by a toned and flat chest through what you could guess to be years of regular training. The plate which ends at the top of her hips gives away her wide, child-bearing waist which stands out particularly in comparison to the rest of her body.\n\nWeapons\n\nShe carries a fairly simple blade and shield to compliment it. The shield has a steel buckle attached to the front via three knots of rop, and the edges are reinforced with iron as well as the back which has criss-crossings of leather to make the oak all the more sturdy. Her blade is a fairly simple steel longsword, about thirty-eight inches in length. The blade is broad, and is suited for the purpose of versatility. It bears many marks and scratches, and appears to have seen extensive use.\n",
				},
