					["4"] = {
						["AC"] = true,
						["TI"] = "Equipment",
						["IC"] = "TRADE_ARCHAEOLOGY_SILVERDAGGER",
						["TX"] = "Dusk is usually either seen strapped into her blue and gold set or a more casual attire.\n\nShe always carries her daggers on her hips and a few knives strapped to her thighs and tucked into her shoulderpieces. On occasion, she'd brandish a flintlock tucked into the back of her belt.\n\nCustom Flintlock: Attached to the back of her belt - and shown freely - is an ornate flintlock; the barrel hand-crafted and carved and the handle complete with blue accents. Quite a sight.",
