			["about"] = {
				["read"] = true,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Darkness:512:128}\n{h2:c}Remasa Davenport{/h2}\n\n{p:c}Remasa hails from the background of a middle classed family that treated her well and kept her safe, giving her a healthy childhood until the age of nineteen. Through a damning moment  in her life, she found herself poor and weak, forced to fend for herself in the streets of Stormwind City.\n\nRecently, however, she stumbled into the crew of The Dainty Damsel. She now seeks to explore the world with them, and learn how the life of a privateer is, like her father before her.{/p}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{h3:c}[Appearance]{/h3}\n\n{p:c}Tied neatly in a ponytail, Remasa's fiery locks stands out rather beautifully and reveals a good condition. Her face looks like pure innocence and youth, yet at times a grim expression is visible, should one look close enough. Her eyes of emerald gleam are both delicately located on either side of a buttoned nose, showing her natural beauty on her face. Further down, her thin naturally red lips are shown, appearing in a nice shape.\n\n\nHer slender neck leads down to a slim frame, revealing a soft hourglass from the curves and muscles starting to show after hard work at sea, and healthy food that she gets down her system, as she should. Her skin colour looks slightly sunkissed and soft.\n\n\nAs for the equipment seen worn by Remasa, one would see sailor's clothes, green by colour, made of linen probably. It would not be very protective, but it'll do. A weapon is also seen located by the left side of her waist with leather strips attached to her cloth belt, keeping the sheathe in place. When drawn, it is a rapier, used to defend herself-and fight with, or for simple sport.{/p}\n",
