			["about"] = {
				["v"] = 72,
				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-rogue-cover:256:256}{col:000000}{col:000000}{/col}{/col}\n{col:000000}{/col}\nThis description is more of a miscellaneous-information about the character that you might want to know, or are curious about. I'm not about to make a novel and a half about how his fur is gray, you can see what he looks like.\n\n\n\nTheme: Will get one if anyone's interested\n\n\nVoice reference: You can imagine whatever you want, as long as it's worgen-like and has a Gilnean accent.\n\n\nAlignment is chaotic neutral\n\n\nSeeing his human form is rare, and he prefers not using it or showing it, but can happen on occasion\n\n\nHe is weak-minded. He goes with the flow, wherever it may take him. He has a strong will to live, he is an arguably nice person and relies a lot on experiences and what he has learned throughout the six years this character has existed, whenever Cataclysm started\n\n\n\nHis efficiency and utility in combat is valuable, and he works well with scouting and infiltration, but without someone telling him what to do, it would be rare for him to actually do anything\n\n\n\nHe has a very developed sense of empathy, being able to put himself in the shoes of most people, even his enemies, although he may not always show it.\n\n\nIf you are using fel magic, and your character is trying to hide it, do not be surprised if Alt can sniff it out. It is canon that fel has it's own smell.\n\n\nHis backstory is formed by past events. The character was made in early Cata. He keeps most of it a hidden, but get close enough to him, and ask the right questions, you'll find out what his past was truly like.",
