					["TX"] = "A strong woman with a firm and welltrained body stand before you. Her frame is feminine, but clearly toned with muscles, showing in the right amount for a woman in good shape. Her features are eyecatching when your eyes follow her hourglass figure. A wellshaped bosom mostly settled firmly behind the plate armour. The welltrained waist reaches down to her curvy hips and behind, above a pair of long legs.\nHer face is pretty, faire skin with a pair of deep red lush lips. Above them a fine nose, settled between a pair of stunning crimson eyes, surrounded by a veil of thick long pitch black lashes. All of it encased by thick waistlong raven hair, some of it shortened by the side of her face in stray strands.\nHer voice is as strong as the gaze in the burgundy eyes and leaves the impression of a woman who's seen much, and knows no fear.\nHer walk is a steady, firm militaristic stride, carried out with a certain grace should she be in a dress for once.\nHer poise strong and straight, always with a certain tension to her frame, ready to move quickly should it be necessary.\nCarola always carries two hidden daggers.\n\nScars:\nA very thin white line runs across her neck from ear to ear, only visible if she lifts her neck or inspected up close.\nAn approx three inch long and one inch wide scar on her left hip.\nMiddle of upper left arm, a scar runs across it horizontally.\n\nLink to artwork : http://imgur.com/bFzUBAO\n\n\n\n{img:Interface\\ARCHEOLOGY\\ArchRare-WispAmulet:512:256}",
