			},
			["about"] = {
				["T1"] = {
					["TX"] = "{p:c}{col:fdfdfd}Sullen and reticent, Varner cuts an unassuming hooded figure in the crowds of the city. She stands taller than most women, her ungainly frame clad in plated mail fitted enough well to hide a soft yet athletic body. A curved blade more fitted to a Tirassian then a woman of the North rests at her side and with it sits a dagger hidden beneath her cloak. \n\nThe woman seems to be gifted with an eerie beauty; an angular countenance, the jagged edges of her jaw and high cheekbones looking as if they can cut glass, is mounted upon skin as pale as milk; unblemished and pure. Washed out eyes more befitting a serpent than gracing a human gaze out from under arched brows, curved and thin. Yet this beauty seems offset by the severe expression that falls on her countenance, with thin lips unwilling to provide even a smile, lest her paper like skin cracks from the movement. Strands of spun silver cascade down past her shoulders, usually hidden under a hood that frames her features frequently. The only sense of colour on this woman seems to the wine stain birthmark that stretches from her neck to her right cheek, giving the appearance of a raven with its wings spread.\n\nHollow charms and courtesies fall from her lips; a false sense of neutrality masking her uninterest and disdain to the conversation unless it is information she requires. Her voice is husky and gravelly, a marked contrast to her soft appearance.{/col}{/p}",
