						["AC"] = true,
						["TI"] = "Character sheet:",
						["TX"] = "Name: Jade Melissa Bruck\nAge: 21-23\nEyecolor: Blue/gray\nHeight: 5'6\nBody: Agile/slim\nCurrent residence: Redridge mountains.\n-------------------------------- \nMood: Tired and slightly beaten.\nWounds: Cut on her left cheek and right cheek appears to be bruised.\n--------------------------------\nRelationship: Taken.\n\n",
