					["4"] = {
						["AC"] = true,
						["TI"] = "Clothing/Pouches/Belt",
						["IC"] = "INV_Chest_Cloth_70",
						["TX"] = "Jade her casual attire would be a rather simple one, but stil something that fit nicely on her body. A light vest that would be mixed with a corset would sit over her torso, being simple, black with golden tints. And there would be no sleeves attached to the corset. There. For Jade would wear a thin shirt under it mostly for the long sleeves that widened out at her wrists. Attached at her shoulders would be a black, long cape to match the vest with. However,\n\n hidden behind the view of her back there would a firm leather holster that was attached to the belt. Placed within the holster would rest a Breechload-Flintlock, used for self-defense. She'd have two small pouches placed upon the front of her belt resting neatly and tightly around the belt to ensure they'll not fall or clip off without intention. The content of her pouches varies from time to time, mostly containing the following items;\n* Silver coins.\n* Bandages/Strips.\n* Foldable stiletto styled knife.\n\nOn the front one may also notice a red little satchel attached to the belt using a little rope. In here one can find supplies for her flintlock pistol that was earlier mentioned, holding an handfull of cartridges for her pistol.",
					},
