				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{h1:c}Physical description{/h1}\nJade is what most consider a 'young adult' this is pretty noticeable on her voice and facial expression together with her slim and youthfull build. Her from naturally golden blonde hair has a slightly darker colour ontop, the silky hair falling down to her shoulders and stylishly curls on the end just above her bust and back. If one would look towards her glimmering eyes they'd notice the colour green, she even heard people with green eyes are somewhat 'special'!\nJade's face is fairly young looking, one might even be able to notice her begin twenties age just by looking at her. A few freckles around the cheek area and a thin noseline. Further her bust Isn't huge or any special and not really worth noting, as the same goes for her butt, they're curvy and normal how they're suppost to be for someone of her length!\n\nJade her length is rather short and this also applies for her feet and hands, people are most fond of her assumingly cute small hands and thin fingers. Albeit the fact she hates them. Her nails are most of the time unpolished. \n\nVoice: Kristina Romanova\n\n{img:Interface\\LFGFRAME\\LFGICON-THEBATTLEFORGILNEAS:256:256}\n",
