		["0211204447DrVAw"] = {
			["character"] = {
				["CO"] = "Feel free to approach when I am IC",
				["RP"] = 2,
				["CU"] = "Walking around with a smile\nSmells like the sea\n",
				["XP"] = 2,
				["v"] = 50,
			},
			["time"] = 1499369067,
			["zone"] = "Feralas - Feathermoon Stronghold",
			["about"] = {
				["BK"] = 2,
				["T3"] = {
					["PH"] = {
						["TX"] = "In front of you stands a young Kaldorei. Her face is smooth and always seems to bear a smile from one ear to the other. Her hair is short, and usually set up with a small pony tail in the back. It is usually also wet and sticky, as if she's just come of out a bath of some sort. Her hair is white as clouds, and, whenever dry, soft as silk.\n She never seems to wear shoes, which also has made her feet unusually dirty. \nHer eyes are the brightest of silver, and always seems to have kindness, happiness and adventure in them. She does not seem like the person anyone would hate.\nHer body is small, slim and fragile-looking. She does not have much muscle, unlike her older brother. She is quick and agile instead, making her the quick one of the Shadowstone's.",
						["BK"] = 5,
					},
					["PS"] = {
						["TX"] = "Edraeth is the typical happy, bubbly and outgoing child. She sees nothing evil in anyone, which is at some point actually a bad trait, as she will look past any evil thing in a person and do all she can to befriend any who crosses her path. She loves to talk and make friends.\nSomething she loves more than friends and talking however, is her trade. She loves the smell of smelting metal and newly forged weapons and armor, and is often seen in her brother's workshop, helping him wherever she can. Due to this, she has become a quite good blacksmith from an early age. \nShe loves the sea, and anywhere she can fish in general. She does not fish in the general way, however. She goes head on and dives into whatever water she can find, and catches the fish with her bare hands.",
						["BK"] = 8,
					},
					["HI"] = {
						["TX"] = "When Edraeth was but a baby, she lost her parents in the line of duty, leaving her with but an older brother, who by the time was already past the adulthood line. He took care of her, and took her with him. Not soon after, a woman named Sivh, a sentinel from Mount Hyjal, took the two under her wings. She herself had a daughter carrying the name of Cían, not much older than Basalt, Edraeth's brother.\nSivh took care of the siblings as if they were her own, and Edraeth never got to know her as anything else but 'Mum'. She does not recall her birth parents. Sivh has always been the one there to care for her, to pick her up from the ground whenever she ran too fast, stumbled and needed help to get up again, in every way that can be undestood.\nWhen Edra was able to tend to herself, she quickly took on the trade of her older brother, following him whenever he came home from his many adventures. She learnt the trade of blacksmithing from an early age. Basalt let her travel to other cities, other cultures, to bring back blueprints of different ways of forging, as well as having that be an experience for her. This has lead to many adventures during her -In the eyes of a Kaldorei- short life.\nAnd now, she resides in Darnassus with her brother, Basalt Shadowstone. Here, they work at the forge and help around wherever they can.\nEdraeth still travels around, and has recently shown interest in joining a group of sentinels as their personal blacksmith\n\nKnown family:\nBrother: Basalt Shadowstone - Blacksmith in Darnassus\nAdoptive mother (Unknown about this): Sivh (Need to check surname) - Druidess, former sentinel of Mount Hyjal\nAdoptive sister (Unknown about this): Cían Wolfsbane (Need to check surname) - Sentinel\nAdoptive niece from Cían's side: Allium\nAdoptive nephew from Cíans side: Thiandis\nAdoptive nephew from Cíans side: Arrel",
						["BK"] = 15,
					},
				},
				["TE"] = 3,
				["v"] = 10,
			},
			["misc"] = {
				["PE"] = {
