						["TX"] = "A harsh life at sea has left Sorrel built like a barrel with limbs. His skin is leathery and weatherbeaten, his hair windswept, stiff with salt and streaked with grey. His eyes, however, are lively and as silver as the stars.\n\nThere is a savage aspect to his features - heavy brows, large fangs and a broad nose. One can almost see an evolutionary throwback to the trolls.",
