		["0311123800fubgp"] = {
			["character"] = {
				["CO"] = "Appearance:\ntinyurl.com/alerinne-ad\n",
				["RP"] = 1,
				["CU"] = "Skulking around.",
				["XP"] = 2,
				["v"] = 56,
			},
			["time"] = 1499638956,
			["link"] = {
				["Alerinne-ArgentDawn"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "\n\n{img:Interface\\Pictures\\artifactbook-hunter-thasdorah:512:256}{p:c}{link*http://tinyurl.com/ad-alerinne*A sketch of Alerinne}{/p}\n\n{h2:c}{col:ffffff}Appearance{/col}{/h2}\n\n{p}{col:ffffff}Alerinne is a strange elf, but not in the way that she would stand out in the middle of a crowd, definitely not. It's actually quite unlikely to even see her in one, since she might appear timid and reclusive at first.\n\nUnfortunately for her, her appearance only further fuels this shy impression she gives off. She doesn't have any strong, sharp features, her eyes are quite big and her cheeks ever so slightly chubby.\nIn fact, Alerinne doesn't want to be shy and timid at all, she hates this side to herself, and she does her best to overcome her diffident nature by forcing herself into social interactions, which may end up being rather awkward.\nThe elf's body is like that of many other kaldorei, she looks slim and fit, her long limbs however don't show many muscles. But it seems that despite she might not be the strongest, her lack of brute force is compensated with her dexterity and precision.\n\nWhile she carries herself with deadly elegance in combat, she appears like a completely different person when she is just casually walking around. If you even noticed her, she would likely walk close to a nearby wall, hesitantly looking around, with her arms either crossed over her chest, or awkwardly and uncomfortably tucked in her pockets. That is unless you caught her amidst an awkward social interaction with virtually any unlucky bystander, that she decided to talk to in a desperate attempt to overcome her reclusiveness.\n\nThere are situations, however, in which she acts as a whole different person, and that is amongst the very few people she feels comfortable around, or when she gets desperate enough to bolster her courage with alcohol.\n{/col}{/p}\n\n\n\n\n\n\n\n\n\n",
