		["0522024103i1Ztb"] = {
			["misc"] = {
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Bracers",
						["TX"] = "Greg utilises a pair of tempered truesteel bracers upon his person. He doesn't deploy a shield in combat, but instead exploits the protective quality of his bracers to defend against some slashing attacks.                                   ",
						["IC"] = "inv_misc_addsocketbracer",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Burn",
						["TX"] = "All up his left arm is a horrific burn mark, scarred over from the passage of time. It stretches from his fingertips to his shoulder, and spreads slightly to his pectoral.",
						["IC"] = "Spell_Fire_Immolation",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "Amulet",
						["TX"] = "Dangling around Greg's neck is a silver chain, which enclasps a red crystal as the jewell. This trinket was acquired by him during his travels, and was used to combat a magus which caused him strife.\n\nThe amulet is enchanted, with its purpose being to ward physically harming spells. The red gem is no ruby, but instead more of a power source, supplying the amulet with the mana to ward off such attacks. It will not last forever, and does have finite uses. Incoming spells, if harmful, would seem to hit a wall; if this amulet is charged.",
						["IC"] = "INV_Jewelry_Necklace_57",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "'Longfinger'",
						["TX"] = "This straight sword is sufficient in most respects, and effective in most situations if wielded properly. Those who aspire to master the sword are certain to wield a Longsword at some point during their journey.\n\nThe blade is well looked after, being sharp and polished; the hilt is wrapped and weaved in red and black leathers, with a ruby resting at the button. Greg bestowed the name 'Longfinger' to his blade, after it eventually felt like an extension of his own hand through extended practice.",
						["IC"] = "INV_Sword_28",
					},
				},
				["ST"] = {
					["1"] = 1,
					["3"] = 1,
					["2"] = 1,
					["5"] = 4,
					["4"] = 0,
					["6"] = 0,
