				["v"] = 36,
			},
			["link"] = {
				["Skelding-ArgentDawn"] = 1,
			},
			["about"] = {
				["v"] = 36,
				["BK"] = 3,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PETBATTLES\\Weather-Windy:512:128}\n\n\n{h1:c}{col:656565}Gregory Charles Skelding{/h1}\n\n{p:c}{col:656565}\"Always shake with your right hand, but hold a dagger in your left.\"{/p}{/col}\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:32}\n\n{p:c}{col:656565}An oval face with angular cheekbones and a sculptured jaw, concealed only by a scruff of dirty blonde stubble, or occasionally a fully fledged, bristled beard. The champagne hair atop his scalp usually sits brushed back, neat and tidy, away from his visage. The very slight evidence of age has crept up upon his face, with fledgling crow's feet and a glabellar line between his brows.\n\nDeep set and striking emerald eyes burn with a molten envy, their intensity only increased by his rugged blonde brow. His slighty tanned and weather beaten skin is an immediate give away to his transient style, being quite frequently on the road. Coupled with his facial appearance is his strapping build and large, sturdy hands - a telltale sign for a physically powerful individual. His torso and arms are littered with scars, each a harkening call to his obvious empiricism in combat.\n{/p}\n\n{p:c}{link*http://movies.mxdwn.com/wp-content/uploads/2013/07/ewan-mcgregor-jan-2013-five-.jpg*Facial Inspiration}{/p}\n\n\n",
